INSERT INTO `tbpegawai` VALUES (1, '195709051988031002', '2005095701', '3578220509570003', NULL, '2012-08-15', '2017-09-09', '77-823662-0-608-000', NULL, 'PNS', 2, 'Prof. Dr. H. Abd Ala, M.Ag', 35, 3578, 357822, 3578221001, 60231, 'Perumahan Lotus Regency RT/RW 002/009 Ketintang Kecamatan Gayungan Kota Surabaya.', 'Perumahan Lotus Regency RT/RW 002/009 Ketintang Kecamatan Gayungan Kota Surabaya.', 35, 3578, 357822, 3578221001, 60231, 1, 2, 'Laki-laki', 'Sumenep', '1957-09-05', 165, 65, 'Lurus', 'Bulat', 'Kuning Langsat', '-', '-', 11, 373, '38c6d-foto-prof-ala.jpg', '08123209143', '08123209143', 'abdalabs@gmail.com', 'WNI', 'http://blog.sunan-ampel.ac.id/abdala', NULL, 'A4011410', '2017-11-01', 'Indonesia', 'AB', '-', 1, 131, 130, 100, '18341-0a807-ksk-baru.pdf', 8, '09210180327', 1, 4, 15, 'Prof. Dr. Abd. A\'\'la, M.Ag., lahir di Sumenep, 5 September 1957. Pendidikan dasar dan menengah diselesaikan di Madrasah An-Nuqayah, Guluk-Guluk, Sumenep. Setelah itu, dia melanjutkan jenjang Strata Satu (S1) di Fakultas Sastra IAIN-kini beralih status menjadi UIN Sunan Ampel Surabaya. Gelar Magister dan Doktor diraih dari IAIN Syarif Hidayatullah, Jakarta (sekarang UIN).\n\nSelain melakukan berbagai penelitian, dia juga konsen dan terlibat aktif dalam penyelesaian problem konflik sosial-keagamaan di Tanah Air, seperti sebagai Konsultan pada Konsorsium Keadilan dan Kedamaian (KKK) Malang (2002-sekarang), Aktivis Jaringan Islam Anti-Diskriminasi (JIHAD) Surabaya (2005-sekarang), National Board pada Internasional Center for Islam and Pluralism (ICIP) Jakarta (2003-sekarang), Anggota Paripurna Komisi Nasional Anti-Kekerasan terhadap Perempuan (2007-2009), Ketua Tim Rekonsiliasi Konflik Sunni-Syiah Sampang (2012-sekarang), dan menjadi delegasi Perdamaian Palestina-Israel (September, 2007).\n\nTulisan-tulisan populernya kerap dipublikasikan oleh Kompas, Koran Tempo, Media Indonesia, Seputar Indonesia, Jawa Pos, Republika, dll. Bukunya yang sudah terbit diantaranya Melampaui Dialog Agama, Kumpulan Tulisan Opini Kompas (Paramadina, 2003), Pembaharuan Pesantren (Pustaka Pesantren-LKIS, 2006), dan Agama Tanpa Penganut (Impulse-Kanisius, 2009).\n\nKini, selain menjadi Guru Besar Bidang Sejarah Perkembangan Pemikiran Islam, Fakultas Adab dan Humaniora, juga menjabat sebagai Rektor Universitas Islam Negeri (UIN) Sunan Ampel Surabaya, periode 2014-2018.', 'Sejarah Perkembangan Pemikiran Islam');
