INSERT INTO `tbpegawai` VALUES (134, '198109082009101002', NULL, '3578190809810002', NULL, '2012-05-02', '2016-09-08', '35.838.040.0-604.000', NULL, 'PNS', 1, 'Sodikin, S.Pd.I', 35, 3578, 357819, 3578191003, 60198, 'Jl. Kendung Jaya III No.15 Kel. Sememi Kec. Benowo - Surabaya', 'Jl. Kendung Jaya III No. 15 Surabaya\nRt.001 Rw.006\nKel.Sememi Kec.Benowo', 35, 3578, 357819, 3578191003, 60198, 1, 2, 'Laki-laki', 'Tuban', '1981-09-08', 172, 56, 'Lurus', 'Oval', 'Sawo matang', NULL, 'Normal', NULL, 185, 'aa80d-fotoku-2.jpg', '0318493836', '08977447779', 'dickyalfarras@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'A', 'Otomotif', 1, NULL, NULL, NULL, '580a2-kk.jpg', 5, NULL, 0, 0, 6, 'Nama saya Sodikin yang akrab dipanggil \"dicky\" lahir pada tanggal 8 September 1981 di TUban, Jawa Timur. Saya Lahir dari pasangan Bapak Suntoko dan Ibu Fatonah. Saya semasa kecil menghabiskan waktunya bersama kedua orang di Tuban. Memulai pendidikan Sekolah SD Panyuran lulus Tahun 1995 melanjutkan Sekolah SMP Mu\'\'allimin Tuban tepatnya di daerah Kelurahan Makam Agung lulus Tahun 1998, kemudian melanjutkan pendidikan kejuruan di SMK YPM 12 Tuban lulus Tahun 2001. Seusai lulus SMK saya lebih fokus membantu pekerjaan orang tua di rumah dan bekerja srabutan. Kemudian pada Tahun 2005 saya di tawari kakak saya yang bekerja di Kampus Islmai yang berada di Surabaya yaitu IAIN Sunan Ampel tepatnya di Fakultas Dakwah yang sekarang sudah berubah nama menjadi UIN Sunan Ampel Surabaya. Setelah mengajukan lamaran pekerjaan saya di terima di Fakultas Dakwah IAIN Sunan Ampel tepatnya di Staf Sub Bagian Umum dari Tahun 2005 s/d 2007. Kemudian setelah di terima di Kampus Fakultas Dakwah pada bulan April 2005 saya melanjutkan pendidikan sarja di Kampus STIT TARUNA Surabaya lulus Tahun 2009 dengan mendapat gelar Sarjana Pendidikan Islam (S.Pd.I).Pada Tahun 2007 pindah rolingan di Lembaga Penelitian IAIN Sunan Ampel sampai Tahun 2013 kemudian mendapat rolingan lagi Fakultas Adab dan Humaniora sampai sekarang. Saya diangkat menjadi Capeg pada Tahun 2009 kemudian menjadi PNS pada tahun 2011. ', 'Kemampuan public speaking, menulis, atau membangun tim. ');
