INSERT INTO `tbpegawai` VALUES (165, '196405291994032001', NULL, '3578206905640001', NULL, '2014-07-02', '2019-05-29', '77.832.731.2-618.000', NULL, 'PNS', 1, 'Noor Tatik Handayani, S.Ag, M.Pd.I', 35, 3578, 357820, 3578201001, 60228, 'Graha Sunan Ampel Blok L-19', 'Graha Sunan Ampel Blok L-19', 35, 3578, 357820, 3578201001, 60228, 1, 2, 'Perempuan', 'Ngawi', '1964-05-29', 150, 65, 'ikal', 'bulat', 'coklat', NULL, NULL, NULL, 191, '967c1-20140202_144317_001_001_001.jpg', NULL, '081330229111', 'noortatik@uinsby.ac.id', 'WNI', NULL, NULL, 'A0427347', '2011-05-13', 'Indonesia', 'O', 'olah Raga Volly, membaca', 1, NULL, NULL, NULL, 'e2426-2.jpg', 53, NULL, 0, 0, 13, 'Lahir di kota Ngawi 29 Mei 1964, sekolah di SD Negeri Beran 2 Ngawi lulus th 1976, melanjutkan SMP Negeri I Ngawi lulus th 1980. Karena Ayah bekerja di Surabaya sebagai Wakil Rektor III di IAIN Sunan Ampel lulus SMP pindah ke Surabaya. Kemudian melanjutkan di SMA Negeri 2 Surabaya. Tahun 1981 Ayah meninggal dunia. Dan setelah lulus SMA th 1983 saya mengikuti Kursus2 untuk bekal bekerja. Ada sahabat Ayah yang menyarankan untuk bekerja walaupu sebagai tenaga Kontrak di IAIN. Tahun 1992 Ibu menyusul meninggal dunia.Tahun 1994 Alhamdulillah saya bisa lolos mengikuti tes PNS di IAIN Sunan Ampeldengan Ijazah SLTA/gol.II/a. tahun 1997 menikah dengan seorang laki-laki yang bernama Sya\'\'bani, tgl 4 Nopember 2000 lahir anak laki-laki yang bernama Muhammad Iqbal Syah. Karir Kepegawaian saya berjalan terus kemudian diangkat sebagai Kasubag Akademik dan Kemahasiswaan di Fak.Syari\'\'ah, kemudian sebagai Kasubag Perencanaan, Akuntansi dan Keungan dan Pangkat terakhir saya Pembina pada golongan IV/a dan menjabat sebagai Kabag FEBI dan FISIP UIN Sunan Ampel Surabaya sampai sekarang. ', 'Membaca untuk menambah ilmu, mengikuti kegiatan yang bermanfaat untuk menempa dan memperbaiki diri agar kedepannya menjadi lebih baik.');
