INSERT INTO `tbpegawai` VALUES (219, '197006122000032003', NULL, '3515115206700002', NULL, '2012-04-05', '2017-06-12', '47.431.290.7-603.000', NULL, 'PNS', 1, 'KUTSIYATIN, S.Ag., M.Si', 35, 3515, 351511, 3515112007, 61262, 'Dusun. Babadan RT 12 RW 04 ', 'Jl. Raya Junwangi, Dusun Babadan RT.012 RW.004, Desa Junwangi', 35, 3515, 351511, 3515112007, 61262, 1, 2, 'Perempuan', 'Sidoarjo', '1970-06-12', 160, 70, 'Lurus', 'Oval', 'Kuning Langsat', 'Tahi lalat di pipi kanan', NULL, 7, 239, '20ce0-1.jpg', '0318984068', '085706313239', 'febiuinsa@gmail.com & febiuinsa@yahoo.com', 'WNI', 'http://www.febiuinsby117.blogspot.com/', NULL, NULL, NULL, NULL, 'B', 'olah raga', 1, NULL, NULL, NULL, '1fd41-kk.jpg', 53, NULL, 0, 0, 13, 'CURRICULUM VITAE\nNama 			: Kutsiyatin, S.Ag, M.Si\nNIP			: 197006122000032003\nPangkat/Gol		: Pembina ( IV/a )\nTempat tgl lahir	: Sidoarjo, 12 Juni 1970\nAlamat			: Dusun Babadan RT 12, RW 04, Desa Junwangi, Kecamatan Krian\nStatus			: Kawin 2 anak\nPendidikan 		:\n1.	Tahun 1984, lulus MI Mambaul Ulum Terik Krian\n2.	Tahun 1987, lulus SMP Negeri 1 Krian\n3.	Tahun 1990, lulus SMA Negeri 1 Krian\n4.	Tahun 1994, lulus S1 IAIN Sunan Ampel Surabaya Fakultas Dakwah Jurusan BPM (Bimbingan Penyuluhan Masyarakat)\n5.	Tahun 2002, lulus S2 Unmuh Malang Prodi Sosiologi\nPengalaman Mengajar:\n1.	Tahun 1990-1994, sebagai guru TPQ di Ketintang Baru Surabaya\n2.	Tahun 1994-2000, sebagai guru tidak tetap di MI dan MTsN di Krian\n3.	Tahun 2001-2006 , sebagai Dosen Tidak tetap (DLB) di Fakultas Adab IAIN Surabaya\nPengalaman Jabatan Pegawai di UIN Sunan Ampel Surabaya:\n1.	Tanggal 1 Juli 2000, sebagai Calon Pegawai staf Subbag kepegawaian di Fakultas Adab,\n2.	Tanggal 5 Oktober 2000, sebagai staf Umum/Perpustakaan di Fakultas Adab,\n3.	Tanggal 1 Agustus 2001, sebagai Staf Subbag. Kepegawaian di Fakultas Adab,\n4.	Tanggal 8 April 2002, sebagai Staf Subbag. Akademik dan Kemahasiswaan di Fakultas Adab,\n5.	Tanggal 1 Juni 2006, sebagai Staf Subbag. Keuangan di Fakultas  Adab,\n6.	Tanggal 1 Juli 2013 , sebagai Kepala Subbag. Evaluasi dan Pelaporan Program dan Anggaran di Bagian Perencanaan UIN Sunan Ampel Surabaya.\n7.	Tanggal 3 Juni 2014 sampai sekarang sebagai kepala subbag. Administrasi Umum dan Keuangan pada Fakultas Ekonomi dan Bisnis Islam UIN Sunan Ampel Surabaya.\nSurabaya, 18 Pebruari 2016\nHormat Kami,\n\nKutsiyatin,\n', '');
