INSERT INTO `tbpegawai` VALUES (242, '195504031981032008', '2003045501', '3578234304550001', NULL, '2012-04-03', '2017-04-03', '78.937.363.6-609.000', NULL, 'PNS', 2, 'DR. Hj. Siti Ruchanah, M. Ag     ', 35, 3578, 357823, 3578231004, 60234, 'PURI TAMAN ASRI KAV. AA-7', 'PURI TAMAN ASRI KAV. AA-7', 35, 3578, 357823, 3578231004, 60234, 1, 2, 'Perempuan', 'Mojokerto, 03 April 1955', '1955-04-03', 150, 53, 'putih', 'oval', 'sawo matang', '-', '-', 2, 387, 'c625e-c4d56-dsc_5342.jpg', '0318299380', '081553367899', 'sruchanaha@yahoo.co.id', 'WNI', '-', NULL, 'V 113365', '2010-04-28', 'Indonesia', 'B', 'membaca', 1, 153, 150, 100, 'c63a7-untitled-14.jpg', 28, '13 2 1018 11759', 0, 0, 14, 'Dr. Hj. Siti Ruchanah, M.Ag., dilahirkan di Mojokerto, 3 April 1955, sebagai dosen UINSA Surabaya, Jl. A. Yani 117 Surabaya, yang bertempat tinggal di Puri Taman Sari Kav. AA-7 Surabaya, menikah dengan Drs. H. Abd. Rachim, M.Si., dengan memiliki anaknya Eva Rosyida, SE., Dr. Shinta Maharani, SE.MAK., Rahardian Mahendra, SE., Moch. Reza Adity, SH, MHi, dan memiliki menantu Ir. Andoko Tri Atmaja, Moch. Singgih Aryaduta, Dr. Miftahul Ulum., dan cucu yang di miliki Siti Carissa Atmaja, Moch. Singgih Aryaduta, beliau di lahirkan dari orang tua yang bernama H. Johanes Arief (alm). Hj. Nafi\'\'\'\'ah (alm), kemudian beliau mengenyam pendidikan dasar sampai perguruan tinggi antara lain SR Negeri Dlanggu 1967, MINU Dlanggu Mojokerto 1968, SMP Harapan Dlanggu Mojokerto 1971, PGAP Dlanggu Mojokerto 1971, PGAN 6 Tahun Mojokerto 1973, SPG II Surabaya1975, Sarjana Muda UMS 1979, Sarjana S1 IAIN Surabaya 1987, S2 UMM 2000, S3 IAIN Sunan Ampel Surabaya 2010. inilah beliau secara singkat.', 'Menulis\nMembaca\nMengajar');
