INSERT INTO `tbpegawai` VALUES (247, '196411111993031002', '2011116401', '3573051111640004', NULL, '2012-07-06', '2017-11-11', '47.431.244.4-623.000', NULL, 'PNS', 2, 'Dr. Ahmad Nur Fuad, MA', 35, 3573, 357305, 3573051004, 65144, 'Jalan Sunan Kalijaga 16 C', 'Jalan Sunan Kalijaga 16 C', 35, 3573, 357305, 3573051004, 65144, 1, 4, 'Laki-laki', 'Lamongan', '1964-11-11', 160, 59, 'Hitam', 'Oval', 'Sawo Matang', 'Tidak Ada', 'Tidak Ada', 3, 373, '64aed-foto-ahmadnurfuad.jpg', '0341558492', '08123259705', 'ahmadnurfuad@yahoo.com', 'WNI', NULL, NULL, 'A 5172347', '2013-04-03', 'Indonesia', 'O', 'Jalan-jalan', 1, 131, 130, 100, '9e279-kk-ahmad-nur-fuad.jpg', 8, '092100900864', 447, 116, 14, 'AHMAD NUR FUAD, lahir di Lamongan, 11 Nopember 1964, menempuh pendidikan dasar diperoleh dari MIM Paciran Lamongan (1971-1976); kemudian melanjutkan ke Kulliyat al-Muallimin al-Islamiyyah (KMI) Pondok Modern Gontor Ponorogo (1977-1983); S-1 pada Jurusan Sejarah dan Kebudayaan Islam Fakultas Adab IAIN Sunan Ampel Surabaya (1984-1991); S-2 pada Islamic Studies, McGill University Montreal Canada (1996-1998); dan S-3 pada Program Studi Dirasah Islamiyah, Program Pascasarjana IAIN Sunan Ampel (2005-2010). Pernah mengikuti Summer Education Course, Faculty of Education, McGill University (1997) dan Management Course, Faculty of Management, McGill University (1997); mengikuti Workshop on Research Methodology di Australian National University, Canberra (2013).\n	Menjadi dosen tetap pada Fakultas Adab dan Humaniora Universitas Islam Negeri (UIN) Sunan Ampel Surabaya sejak 1993; juga menjadi pengajar pada Pascasarjana UIN Sunan Ampel, dan Program Pascasarjana Universitas Muhammadiyah Malang (UMM). Selain itu, menjadi pengajar pada Master Level Course on Shariah and Human Rights pada Program Pascasarjana UMM yang bekerjasama dengan the Oslo Coalition, Norway dan Brigham Young University (BYU), Provo, Utah, USA. Sejak awal 2015, menjabat Ketua Program Studi Dirasah Islamiyah Program Doktor Pascasarjana UIN Sunan Ampel Surabaya.\nPernah melakukan Joint Research tentang Islam and Human Rights in Indonesia dengan bantuan dana dari McGill Project-Canadian International Development Agency (CIDA) tahun 2002/2003 di bawah bimbingan Prof. Wael B. Hallaq. Buku yang diterbitkan antara lain: Islam Milenaris (Surabaya: LPAM, 2002), dan (bersama Cekli Setya Pratiwi dan Saiful Aries), Hak Asasi Manusia Dalam Perspektif Islam (Malang: LPSHHAM dan Madani, 2010). Menjadi kontributor tulisan: Fundamentalisme, Pluralisme dan Dialog Antar-Agama, dalam Terorisme dan Fundamentalisme Agama: Tafsir Sosial, eds. Syamsul Arifin, dkk. (Malang: UMM Press, 2003); Pendidikan Kewarganegaraan: Demokrasi, HAM, Civil Society dan Multikulturalisme (Malang: PuSAPoM, 2007); Konflik Etnik dan Model Resolusi Konflik, dalam Resolusi Konflik Islam Indonesia, ed. Thoha Hamim (Surabaya: LSAS, IAIN, LKIS, 2007); Penguatan Perlindungan dan Penghargaan terhadap Kebebasan Beragama atau Berkeyakinan: Merevitalisasi Peran Tokoh Lintas Agama, dan (bersama Syamsul Arifin) Rekonstruksi Teologis Kebebasan Beragama Menurut Pandangan Intelektual Muslim Australia, dalam Hak Asasi Manusia untuk Kebebasan Beragama dan Berkeyakinan di Indonesia: Keniscayaan, Kenyataan dan Penguatan, eds. Syamsul Arifin, M. Amin Abdullah dan Budhy Munawar-Rahman (Malang: PUSAM UMM-The Asia Foundation, 2014).\n', 'Sejarah Pemikiran Islam; Historiografi Islam');
