INSERT INTO `tbpegawai` VALUES (287, '197604162005011004', '2016047602', '3578241604760001', NULL, '2012-04-10', '2017-04-16', '2016047602', NULL, 'PNS', 2, 'Budi Ichwayudi, M.Fil.I', 35, 3578, 357824, 3578241002, 60292, 'Jl. Kendangsari GG.3/50 Tenggilis Mejoyo Surabaya', 'Kendangsari GG.3/50 Tenggilis Mejoyo Surabaya', 35, 3578, 357824, 3578241002, 60292, 1, 2, 'Laki-laki', 'Surabaya', '1976-04-16', 170, 80, 'ikal', 'bulat', 'sawo matang', 'tampan', '-', 2, 400, '1db5e-dsc_0062---copy.jpg', '082233805512', '08179332010', 'b.ichwayudi@uinsby.ac.id', 'WNI', NULL, NULL, '301911', '2012-07-05', 'Indonesia', 'O', 'reading', 1, 117, 110, 100, 'cfd91-ksk---resize.jpg', 48, '58.726.600.8-615.000', 0, 0, 12, 'CURRICULUM VITAE\n\n1. Nama			:  H. BUDI ICHWAYUDI, M.FIL.I.\n2. NIP.				:  197604162005011004\n3. Tempat/Tgl Lahir		:  Surabaya, 16 April 1976\n4.  Pangkat/Golongan		:  Penata Tk. I  (IIId)\n5.  Jabatan                                :  Sekretaris Jurusan Ilmu al-Qur\'\'an dan Hadis Fakultas Ushuluddin dan Filsafat  \nUIN Sunan Ampel Surabaya\n6. Alamat Kantor		:  Jl. A. Yani No. 117 Surabaya. Tlp. 031-8438369\n7.  Alamat Rumah                          :  Jl. Kendangsari Gg III/50 Kec. Tenggilis Mejoyo Sby\n	Telp. Hp. 08179332010  \n8. Pekerjaan \n?	Dosen Fakultas Ushuluddin dan Filsafat\n\n9. Spesialisasi Mata Kuliah :\n?	Orientalisme \n9.  Pendidikan			 \n a.  SDI Iskandar Said Surabaya. Tahun 1988\n b.  SMPI Iskandar Said Surabaya Tahun 1991\n c.  MAN Surabaya Tahun 1994\n        d. S-1 Jurusan Pendidikan Agama Islam (PAI) Fakultas Tarbiyah \nIAIN Sunan Ampel Surabaya tahun 1998\n e. S-2 Pemikiran Islam PPS (Program Pasca Sarjana) IAIN Sunan Ampel  tahun 2002.\n f. Dalam Proses Studi S-3 Dirasah Islamiyah PPS IAIN Sunan Ampel Surabaya 2013\n                     \n\n\n              \n10. Pelatihan /	Workshop	           \n a.Workshop Metodologi Penelitian di Surabaya  (2007)\n b Workshop Metodologi Penelitian Kualitatif di Tretes Pasuruan (2008)\n c.Workshop Media Pembelajaran di Tretes Malang (2007)\n d. Workshop Satuan Acara Perkuliahan (SAP) di  Tretes Malang (2007).\n e. Workshop   Pengembangan Kurikulum Jurusan Perbandingan Agama ( 2005)\n f.  Workshop PAR (Participation Action Research) di Gunung Kawi Malang (2010)\n g. Workshop  Review and Redesign Curricullum Fakultas Ushuluddin (2011-2012)\n h. Workshop Training on Text Book Development  The Development and Quality Improvement of IAIN Sunan Ampel Surabaya (2011-2012)\ni.  Workshop (Short Course) University of Sydney about Entrepreneurship and Innovation : Teaching, Research and Ventures, (December 2013)\n \n11. Karya Ilmiah / Jurnal / Publikasi       \na. Pemikiran Tasawuf Modern HAMKA dan implikasinya dalam kehidupan masyarakat, tahun 2013\nb. Komparasi Pemikiran Al-Hallaj dan Syaikh Siti Jenar dalam memahami Tuhan, Tahun 2013\nc. Akhlaq Tasawuf Hamzah Fansuri dalam Peta Pemikiran Filsafat Islam di Indonesia, Tahun 2014\nd. Konsep Tariqah dan Suluk dalam Pemikiran Akhlaq Tasawuf, tahun 2014\ne. Tasawuf dalam konsep Syaikh Hasan al-Basri, Tahun 2013\nf. Pemikiran Wahdah al-Wujud tentang Tasawuf dalam perspektif Junaid al-Baghdadi, Tahun 2014\ng. Tasawuf Akhlaqi, Irfani dan Burhani dalam pemikiran filsafat Islam, Tahun 2013\nh. Peran Tasawuf dan Tarekat pada masa modern di Indonesia, Tahun 2014\ni. Studi Pemikiran Tarekat Tijaniyah di Tambak Bening Surabaya, tahun 2012\nj. Ritual Manaqib Syaikh Abdul Qadir al-Jailani dan pengaruhnya dalam kesejahteraan sosial masyarakat di Kendangsari Surabaya, tahun 2015\nk. Teori Emanasi Menurut para Filosof  Muslim, tahun 2014\nl. Filsafat di Dunia Islam : suatu kajian awal perkuliahan jurusan Perbandingan Agama/Studi Agama-Agama. Buku Penerbit Jauhar Surabaya, 2009.\nm.   Paradigma Pemikiran Jalaluddin Rakhmat tentang Shiah (Tesis).\nn.  Pemikiran Tokoh Orientalis Josepht Schatch tentang Hukum Islam, tahun 2012.\no.  Hipokritis Tokoh Orientalis Cristian Snouck Hurgronje, dalam Religio, Surabaya: Fakultas Ushuluddin IAIN Sunan Ampel, ISSN :2088-6330\np.  Kejahatan Agama-Agama dalam perspektif pemikiran Charles Kimball. Buku Penerbit Duta Aksara, 2011.\nq.  Managemen Konflik Keagamaan, Buku dalam proses penerbitan IDB (Islamic Development Bank), tahun 2013\nr.  Pemikiran Filsafat Islam Ibn Sina, tahun 2013\ns.   Al-Ghazali Versus Ibn Ruyd dalam kajian Filsafat Islam, tahun 2014\nt.   Konsep Nabi dalam pemikiran filosof muslim Al-Razi, tahun 2015\nu.  Metafisika dalam perspektif tokoh filosof muslim al-Kindi, tahun 2014\nv.  Hikmah Mutaaliyah dalam perspektif filosof muslim Mulla Sadra, tahun 2015.\nw. Konsep Isyraqiyah dalam perspektif filosof muslim Suhrawardi al-Maqtul, tahun 2015\nx.  Jiwa dalam konsep filosof Muslim Ibn Misykawaih, tahun 2014\ny. novel Islam karya filosof muslim Ibn Tufayl dan analisis pemikirannya, tahun 2014\nz . konsep peradaban dalam perspektif Ibn Khaldun, tahun 2014\ndll.\n\n12.  Seminar-seminar\n\n2007 Seminar Internasional tentang Agama dan Pembangunan diselenggarakan oleh Fakultas Ushuluddin IAIN Surabaya bekerjasama dengan Universitas Kebangsaan Malaysia\n2006 Seminar Internasional tentang Islam dan Isu-isu Kontemporer diselenggarakan oleh Fakultas Ushuluddin IAIN Surabaya bekerjasama dengan Universitas Kebangsaan Malaysia\n\n2008 Nasionalisme Dalam Prespektif Agama-Agama diselenggarakan oleh Lembaga Kajian Agama dan Filsafat (eLkaf) Bekerja sama dengan Jurusan Perbandingan Agama IAIN Sunan Ampel\n2007 Membedah Perilaku Politik santri diselenggarakan oleh Fakultas Ushuluddin IAIN Sunan Ampel Surabaya\n\nDan lain-lain.\n', 'Orientalisme');
