INSERT INTO `tbpegawai` VALUES (290, '198204212009011013', '2021048202', '3515042104820001', NULL, '2010-03-25', '2015-04-21', '34.547.054.6-601.000', NULL, 'PNS', 2, 'Muhammad Afdillah, S.Th.I, M.Si', 35, 3522, 352215, 3522152002, 62114, 'Jl. Serma Abdullah 151 RT 5 RW 1 ', 'Jl. Serma Abdullah 151 RT 5 RW 1', 35, 3522, 352215, 3522152002, 62114, 1, 2, 'Laki-laki', 'Sidoarjo', '1982-04-21', 165, 75, 'lurus', 'kotak', 'sawo matang', 'kaca mata', 'mata kiri protesa', 2, 400, '6a5a5-fotoku.jpg', NULL, '+6281231200202', 'm.afdillah@uinsby.ac.id', 'WNI', NULL, NULL, 'A0374692', '2011-05-09', 'Indonesia', 'B', 'membaca dan traveling', 1, 117, 110, 100, 'd6631-ksk.jpg', 48, '34.547.054.6-601.000', 0, 0, 11, 'Muhammad Afdillah adalah dosen dan peneliti di Prodi Perbandingan Agama UIN Sunan Ampel Surabaya. Alumnus di prodi yang sama ini telah menempuh magister di bidang Ilmu-ilmu Sosial di UNAIR Surabaya dan di bidang agama dan lintas budaya di UGM Yogyakarta. Beberapa kajian yang menarik perhatiannya adalah sejarah agama, sosiologi agama, perdamaian dan kekerasan agama, dan isu negara, agama dan masyarakat. Dia dapat dihubungi via email di m.afdillah@uinsby.ac.id.', 'Sejarah agama, sosiologi agama, perdamaian dan kekerasan dalam agama, Negara-agama-masyarakat');
