INSERT INTO `tbpegawai` VALUES (298, '197411102003121004', '2010117401', '3578021011740003', NULL, '2012-10-19', '2017-11-10', '2010117401', NULL, 'PNS', 2, 'Andi Suwarko, S.Ag, M.Si', 35, 3515, 351516, 3515162013, 52374, 'Jl. Singojoyo II-A 18, Perum Bangah Permai, Bangah, Gedangan, Sidoarjo.', 'Jl. Margorejo no 65 G Surabaya', 35, 3578, 357802, 3578021003, NULL, 1, 2, 'Laki-laki', 'Lampung', '1974-11-10', 166, 74, 'lurus', 'lonjong', 'sawo matang', 'Kumis sama jenggot nyambung', '-', 2, 419, NULL, '082227673838', '08165404951', 'andisuwarko1974@gmail.com', 'WNI', NULL, NULL, 'B-1046588', '2015-05-20', 'Indonesia', 'AB', 'Berorganisasi, membaca, travelling', 1, 412, 410, 300, '6b3c0-kartu-keluarga.jpg', 98, '19.353.520.0-609.000', 366, 98, 12, 'Andi Suwarko dilahirkan hari Ahad 10 November 1974 di sebuah desa di kaki Gunung Tanggamus, desa itu populer dengan sebutan pekon campang. Lahir dengan latar keluarga petani yang religius dan hidup bersahaja. Pendidikan dasar dan menengah di selesaikan di kampung halamanya, mulai di SDN, MTS, MA. Selanjutnya menempuh pendidian tinggi di surabaya, mulai di IAIN Sunan Ampel untuk S-1, Universitas Airlangga untuk S-2dan S-3. Selama mahasiswa aktif sebagai aktifis kampus. Juga bergumul di SLM dan Organisasi Kemasyarakatan. Saat ini menjadi dosen di UIN Sunan Ampel Surabaya.', 'Partai Politik, Pemilu, Parlemen, peradaban Islam');
