INSERT INTO `tbpegawai` VALUES (303, '198212302011011007', '2030128201', '5203023012820003', NULL, '2014-12-31', '2019-12-31', '36.473.636.3-915.000', NULL, 'PNS', 2, 'Zaky Ismail', 35, 3515, 351516, 3515162011, 61254, 'GRIYA PERMATA GEDANGAN, BLOK H-5 NO. 37 KELURAHAN KEBOANSIKEP KECAMATAN GEDANGAN KABUPATEN SIDOARJO', 'GRIYA PERMATA GEDANGAN, BLOK H-5 NO. 37 KELURAHAN KEBOANSIKEP KECAMATAN GEDANGAN KABUPATEN SIDOARJO', 35, 3515, 351516, 3515162011, 61254, 1, 2, 'Laki-laki', 'Lombok Timur ', '1982-12-30', 167, 68, 'IKAL', 'OVAL', 'SAWO MATANG', 'BERKACA MATA', 'TIDAK ADA', 2, 419, 'e1ab0-fotoaicis3.jpg', '031849551', '081803684804', 'zaky.politikislam@gmail.com', 'WNI', 'www.uinsby.ac.id', NULL, 'A 5197837', '2013-04-04', 'Indonesia', 'O', 'MEMBACA', 1, 412, 410, 300, 'dc2b1-kk-kecil.png', 98, '132101811766', 0, 0, 11, 'Zaky Ismail, M.S.I., lahir di Lombok Timur 30 Desember 1982. Pendidikan dasar diselesaikan di daerah kelahirannya yaitu, di SDN 1 Kabar Lombok Timur (1993), Madrasah Tsanawiyah NW Kabar Lombok Timur (1996). Tiga tahun kemudian Pendidikan Menengah Atas berhasil diselesaikan di MAKN Mataram. \nPada tahun itu juga ia hijrah ke kota pelajar Yogyakarta dan menempuh pendidikan S-1 di Fakultas Adab UIN Sunan Kalijaga Yogyakarta (2004), S-2 di Program Pascasarjana UIN Sunan Kalijaga Yogyakarta (2007).\nKarya ilmiah yang telah dipublikasikan antara lain: Gerakan Radikalisme Islam Kontemporer; Sebuah Analisa Sosiologis dan Politis (Jurnal Fikroh Intitut Agama Islam Hamzanwadi Pancor ISSN 1979-9608), Penegakan Supremasi Hukum dalam Al-Quran (Jurnal Ar-Risalah IAIN STS Jambi Volume 11, Nomor 1, Juni 2011, ISSN: 1412-436X), Penaklukan Wilayah pada Masa Awal Islam dan Pembentukan Masyarakat (Jurnal TADIB, Fak.Tarbiyah IAIH Pancor Vol. 3, No. 3, Juli-Desember 2011, ISSN: 2088-6462), dan Kebijakan Politik dan Politisasi Syariat Islam di Lombok Timur (Jurnal Review Politik, Prodi Politik Islam IAIN Sunan Ampel Surabaya Vol. 01, No. 02, Agustus 2011, ISSN: 2088-6241). Buku yang pernah ditulis antara lain Buku \"Teori Politik\" yang diterbitkan oleh IAIN Press tahun 2013.', 'Politik Islam Kawasan');
