INSERT INTO `tbpegawai` VALUES (330, '196811051995032001', '2005116801', '3578024511680005', NULL, '2012-11-28', '2017-11-05', '08.641.319.2-609.000', NULL, 'PNS', 2, 'Dra. Lilik Nofijantie, M.Pd.I', 35, 3578, 357802, 3578021005, 60236, 'JL. SIWALANKERTO UTARA II/28 SURABAYA', 'JL SIWALANKERTO UTARA II/28 SURABAYA', 35, 3578, 357802, 3578021005, 60236, 1, 2, 'Perempuan', 'Surabaya', '1968-11-05', 158, 53, 'LURUS', 'OVAL', 'KUNING LANGSAT', NULL, NULL, 3, 392, '54ac7-dsc01277_2.jpg', '085103603378', '087851644884', 'liliknofijantie@yahoo.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'O', 'MEMBACA', 1, 153, 150, 100, '7b697-ksk.compressed.pdf', 36, '092100900837', 0, 0, 14, 'Nama			 :   Dra. Lilik Nofijantie, M Pd I\nNIP			 :  196811051995032001\nTempat tanggal lahir    :  Surabaya, 5 Nopember 1968\nPangkat/jabatan            :  Pembina (IV/a) / Lektor Kepala\nPekerjaan                      :  Dosen  FITK UIN  Sunan Ampel Surabaya\nFak Wajib		 :   Evaluasi Pendidikan\nAlamat kantor              :   Fakultas Ilmu Tarbiyah dan Keguruan UIN Sunan Ampel Surabaya\nJL. A Yani 117 Surabaya. Tlp. 031  8437893  - 8410298\nFax. 031-8413300\nAlamat rumah              :   Jl. Siwalankerto Utara II/28 Surabaya\nTlp. 031  8432057/ 031  72603378 / 087851644884\n\nPendidikan: \n1.	SD K Ibrahim Surabaya, lulus tahun 1981\n2.	SMP Khadijah Surabaya, lulus tahun 1984\n3.	SMA Khadijah Surabaya, lulus tahun 1987\n4.	S1 IAIN Sunan Ampel Surabaya, lulus tahun 1992\n5.	S2 Pasca Sarjana IAIN Sunan Ampel Surabaya, lulus tahun 2003\n\nPengalaman Organisasi\na. Selama studi\n1.  Sekretaris OSIS SMP Khadijah Surabaya tahun 1982  1984\n2. Bendahara Karang Taruna tingkat  RT kelurahan Siwalankerto tahun 1984  1986\n3 Seksi pendidikan Karang Taruna tingkat RW kelurahan Siwalankerto 1988  1990\n4. Seksi Pendidikan dan Latihan Karang Taruna tingkat kelurahan Siwalankerto 1993 -1995\n5. Bendaharan Klompencapir tingkat kelurahan Siwalankerto 1993 -1995\nb. Selama menjadi Pegawai\n1. Anggota ICMI Wilayah Jawa Timur tahun 1995  2000\n2. Pengurus Wilayah LP Maarif Jawa Timur 2007 -2013 bidang pengembangan SD/MI\n3. Pengurus Wilayah LP Maarif Jawa Timur 2013 - 2019	bidang evaluasi\nRiwayat Pekerjaan:\nPANGKAT	GOL	TERHITUNG	GAJI	SURAT KEPUTUSAN\n				PEJABAT	NOMOR	TANGGAL\nCAPEG	III/a	1 Maret 1995	120.160	Menteri Agama	B.II/3-E/PB.I/4709	29 Maret 1995\nPENATA MUDA	III/a	1 Maret 1997	164.200	Menteri Agama	81/Kp.00.3/SK/P/97/BP.1027	18 Pebruari 1997\nPENATA MUDA	III/a	1 Desember 1998	253.900	Menteri Agama	422/KP.07.6/SK/P/98	18 Pebruari 1998\nPENATANMUDA Tk. I	III/b	1 Oktober 2000	277.300	Menteri Agama	598/Kp.07.1/SK/P/00	16 Desember 2000\nPENATA 	III/c	1 Oktober 2003	1.075.100	Rektor IAIN Sunan Ampel	961/Kp.07.1/SK/P/2003	18 Nopember 2003\nPENATA Tk. 1	III/d	1 Oktober 2005	1.145.800	Menteri Agama	B.II/2/13012	23 Nopember 2005\nPembina	IV/a					\n\nPelatihan/kursus:\n1.	Kursus bahasa asing, proyek perguruan tinggi agama/IAIN Sunan Ampel Surabya No: 54a/PELITA/SA/1995\n2.	Pelatihan Peneliti Tenaga Edukatif tanggal 1 September 1998  27 Nopember 1998, 600 jam. No: 85/TL.00/PUSLIT/98 oleh Proyek Perguruan Tinggi Agama IAIN Sunan Ampel Surabaya.\n3.	Lokakarya silabi kurikulum lokal tahun 1997 Program Sarjana Strata satu (S1) jurusan PAI, KI dan PBA fakultas Tarbiyah IAIN Sunan Ampel Surabaya 11 -13 januari 1999\n4.	Pelatihan PBM Tenaga Edukatif IAIN Sunan Ampel tanggal 29 Maret 1999  - 31 Maret 1999 dilaksanakan oleh IAIN Sunan Ampel.\n5.	Pelatihan Peneliti Tenaga Edukatif Tingkat Lanjut diselenggarakan oleh Proyek Peningkatan Perguruan Tinggi Agama IAIN Sunan Ampel tanggal 14 Juni  10 September 1999. No. 45/TL.00/PUSLIT/1999. 600 jam.\n6.	Workshop KBK Tarbiyah bagi dosen PTAIS (Kopertais) Wilayah IV Jatim, tanggal 8  10 Oktober 2003\n7.	Pelatihan Penulisan dan Penyuntingan Jurnal Ilmiah di Fakultas Tarbiyah tanggal 7 Februari 2004.\n8.	Workshop Peningkatan Strategi Pembelajaran PAI Fak. Tarbiyah IAIN Sunan Ampel Surabaya, tanggal 12  13 Mei 2004\n9.	Workshop penelitian Kualitatif penelitian Etnografi dan aplikasinya yang diadakan oleh Lemlit tanggal 6  7 September 2005\n10.	Pelatihan Metodologi Penelitian Dalam Prespektif Gender Oleh PSG IAIN Sunan Ampel Surabaya tanggal 16-17 September 2005\n11.	Workshop review kurikulum  dan silabi jurusan/prodi PAI.PBA. KI.PBI. dan PMT fakultas tarbiyah IAIN Sunan Ampel Surabaya  tanggal  17 Juni 2008\n12.	Workshop Course Design IAIN Sunan Ampel Surabaya tanggal 24 -25 Juni 2008 diselenggarakan oleh unit peningkatan pengembangan aktifitas pembelajaran.\n13. Workshop review bahan ajar PLPG quata 2008 fakultas Tarbiyah IAIN Sunan Ampel Surabaya tanggal 22 Oktober  2008\n14. Workshop Pengembangan Perencanaan Peran Pusat Studi Gender (PSG) dan Dosen PGMI dalam pelaksanaan Perkuliahan Inklusif bagi konsorsium tanggal  28  29 November 2007 0leh LAPIS PGMI\n15. Workshop penulisan buku ajar evaluasi pembelajaran oleh LAPIS PGMI tahun 2008\n16. Workshop penguatan kapasitas dosen D LAPIS PGMI tanggal 13  15 Oktober 2009\n17. Workshop peningkatan kapasitas guru maarif kabupaten gresik tanggal 17 Januari 2010\n18. Workshop penguatan kapasitas dosen E LAPIS (Learning Assistance program fot islamic Schools) PGMI  tanggal 9 -11 Pebruari 1010\n19. Workshop review penulisan buku ajar PLPG quata 2010 fakultas Tarbiyah IAIN Sunan Ampel Surabaya tanggal 15 Juni 2010\n20. Workshop review kurikulum jurusan KI fakultas tarbiyah IAIN Sunan Ampel Surabaya  tanggal 3  4  Agustus 2010\n21. Workshop on writing testbooks dosen IAIN Sunan Ampel the development adn quality improvement of IAIN Sunan Ampel Surabaya by Goverment of Indonesia (GOI) and Islamic Development Bank (IDB) tanggal 5-8 Mei 2012\n22. Workshop redisign Kurikulum MP  2012 Fakultas Tarbiyah IAIN Sunan Ampel Surabaya\n23. Workshop Penyusunan Media Pembelajaran Aswaja oleh PW Maarif jawa timur  2013\n24. Workshop Penyusunan Rubrik Penilaian skripsi 28  29 Juni 2013\nPemateri:\n1. Peranan Wanita Dalam Pembangunan, pemakalah disampaikan dalam forum dosen Fakultas Tarbiyah Surabaya tanggal 14 Agustus 1995.\n2. Pemateri pada pembekalan KKN  stratefi penyusunan program dan laporan tanggal 8- 9 Juli 2005\n3. Pemateri pada workshop peningkatan mutu pembelajaran bagi kepala sekola/madrasah dan waka kurikulum  tanggal 16-17 Januari 2010 oleh pimpinan cabang LPMaarif NU Gresik\n4. Pemateri Diklat Profesi Guru Agama dalam Jabatan kuota tahun 2006 dan 2007\n5. Pemateri pada  seminar Hepi di UNY  2012\n6. Pemateri pada seminar Hepi di UNESA 2013\n7. Pemateri pada seminar International Pendidikan Islam Serantau Menjawab Tantangan Global IAIN Sunan Ampel Surabaya dengan Universiti Utara Malaysia 1  2 Juli 2013\n8. Pemateri pada Halaqoh FITK tanggal 23 -24 Mei 2014 di hotel Utami\n\nSeminar:\n1. Peserta seminar nasional sehari  Upaya menggali waana tafsir dan hadist tarbawi serta konstribusinya terhadap pengebangan pedidikan Islam fakultas  tarbiyah IAIN Sunan Ampel Surabaya  22 Juli 1997.\n2. Peserta seminar nasional sehari Reformasi sebagai Upaya Pemberdayaan Civil Siciety oleh pusat Informasi dan Kajian Islam IAIN Sunan Ampel Surabaya 25 Pebruari 1999.\n3. Peserta seminar nasional Perempuan dan Media Masa  oleh pusat studi gender IAIN Sunan Ampel Surabaya, 15 Mei 2002\n4 Peserta seminar nasional Reorientasu Pendidikan Islam (Problematika dan Tantangan Fakultas Tarbiyah) 11 Juni 2003 di IAIN Sunan Ampel Surabaya\n5. Peserta seminar nasional pendidikan Islam  Fakultas Tarbiyah IAIN Sunan Ampel Surabaya, 14 Septermber 2002.\n6  Semiloka metodologi penelitian gender  oleh pusat studi gender IAIN Sunan Ampel Surabaya, 17 Septermber 2005.\n\nKarya ilmiah yang dipublikasikan:\n1.	Sekolah Unggul, jurnal Attaqwa, 2003\n2.	Bani Abbasiyah (Analisis Perkembangan Sains dan Pengaruhnya Pada Masa Sekarang), jurnal Al Khozini, edisi 22, Januari 2004.\n3.	Efektifitas Kebijakan Seleksi Penerimaan Mahasiswa Baru Program S-1 IAIN Sunan Ampel Surabaya, jurnal Qualita Ahsana, vol VI no.2, Agustus 2004.\n4.	Kendala sosio-psikologis dalam proses pembelajaran, jurnal al Khozini edisi 24, Januari 2005\n5.	Kebijakan sistem pendidikan di Mesir, jurnal Panca Wahana 2006\n6.	Tugas individu sebagai salah satu bentuk authentik assessment, jurnal Panca Wahana 2007\n7.	Pekerjaan rumah sebagai model authentic assessment, jurnal el-Rohman vol.2 no. 1 Maret 2009.\n8.	Meningkatkan proses pembelajaran melalui moving klas, jurnal el-Rohman vol 2 no 2, September 2009.\n9.	Meningkatkan kualitas pembelajaran melalui lesson studi, jurnal LinkSAS vol 9 Mei 2010\n10.	Partisipasi orang tua dalam pendidikan melalui Komite Madrasah, jurnal at Tarbawi vol 9 no. 1 April  Nopember 2010\n11.	Modernisasai  sistim pendidikan di Madrasah Jurnal penelitian vol 12 no 2 tahun 2011\n12.	(prociding)\n13.	(prociding)\n14.	Praktik PKL mahasiswa jurusan kependidikan Islam fakultas Tarbiyah IAIN Sunan Ampel Surabya tahun 2007/2008 (buku)\n15.	Authentic Assessment (Buku 2009) \n16.	Evaluasi Pembelajaran (Buku 2009)\n17.	Evaluasi Program Pembelajaran (buku 2012)\n\nPengalaman penelitian\n1.	Problematika usaha peningkatan mutu pendidikan dan alternatif pemecahannya (studi kasus di MIN Sedati Sidoarjo), 2002 (Penelitian individual dosen  Fakultas Tarbiyah N0. 641/HK.005/SK/XII/2002 tanggal 13 Juli 2002)\n2.	Efektifitas kebijakan tanpa tes dalam seleksi penerimaan mahasiswa baru IAIN Sunan Ampel Surabaya, 2003. (Tesis)\n3.	Efektifitas Seleksi penerimaan mahasiswa baru IAIN Sunan Ampel Surabaya, 2004. (Penelitian individual dosen oleh LEMLIT No: 061/PDA/P3SA/SK/2004)\n4.	Implementasi sistem akselerasi di Madrasah Tsanawiyah (Studi kasus diMadrasah Tsanawiyah unggulan Amanatul Ummah Surabaya), 2005.(Penelitian individual dosen  Fakultas Tarbiyah no: 673/HK.00.5/SK/XII/2004)\n5.	Peranan kepala sekolah dalam membangun keunggulan pendidikan, 2006\n6.	Modernisasi sistim pendidikan di Madrasah (penelitian individual dosen oleh LEMLIT 2010)\n7.	Model evaluasi soft skill PPL 1 Fakultas Tarbiyah (penelitian individual dosen Fakultas Tarbiyah 2010)\n\n', '');
