INSERT INTO `tbpegawai` VALUES (341, '198002102011012005', '2010028001', '3578045002800005', NULL, '2014-02-13', '2019-02-10', '08.639.261.0.609.000', NULL, 'PNS', 2, 'Dr. Lilik Huriyah, M.Pd.I', 35, 3578, 357804, 3578041001, 60243, 'Karangrejo VI Masjid 1/23 Wonokromo Surabaya', 'Karangrejo VI Masjid 1/23 Wonokromo Surabaya', 35, 3578, 357804, 3578041001, 60243, 1, 2, 'Perempuan', 'Nganjuk', '1980-02-10', NULL, NULL, 'hitam lurus', NULL, 'sawo ', NULL, NULL, 2, 392, NULL, NULL, '087759391170', 'lilikhuriyah@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, NULL, 'reading', 1, 323, 310, 300, NULL, 36, '102126007398', 0, 0, 11, NULL, NULL);
INSERT INTO `tbpegawai` VALUES (342, '198006272008011006', '2027068001', '3522082706800007', NULL, '2012-11-04', '2017-06-27', '88.267.413.8-601.000', NULL, 'PNS', 2, 'Muhammad Nuril Huda, M.Pd', 35, 3578, 357825, 3578251001, 62094, 'Graha Gunung Anyar Kav. 12 Gunung Anyar Lor Surabaya', 'Desa Sidorejo RT. 08 RW. 04 Kec. Kedungadem Kab. Bojonegoro', 35, 3522, 352208, 3522082016, 62195, 1, 2, 'Laki-laki', 'Bojonegoro', '1980-06-27', 165, 60, 'Lurus', 'Oval', 'Cokelat', NULL, NULL, 2, 392, '0c083-nuril-huda-tarbiyah.jpg', '081332267671', '081332267671', 'real_bjn80@yahoo.com', 'WNI', NULL, NULL, NULL, NULL, NULL, NULL, 'Futsal', 1, 153, 310, 300, '8c864-nuril-huda-tarbiyah.jpg', 36, '112 1018 1 813 1686', 117, 36, 11, 'M. Nuril Huda, M.Pd., lahir di Bojonegoro 27 Juni 1980, saat ini sebagai dosen Program Studi Manajemen Pendidikan Islam, Jurusan Kependidikan Islam, Fakultas Tarbiyah dan Keguruan UIN Sunan Ampel Surabaya dengan bidang keahlian Sistem Informasi Manajemen Pendidikan. Jenjang pendidikan SD sampai dengan SMA ditempuh di Bojonegoro, melanjutkan pendidikan strata satu di Jurusan Kependidikan Islam Fakultas Tarbiyah IAIN Sunan Ampel Surabaya. Program Magister S2 ditempuh di Universitas Negeri Surabaya (Unesa) program studi Manajemen Pendidikan.\nSejak di bangku kuliah sudah aktif dalam bidang pendidikan dan pemberdayaan masyarakat. Tahun 2002 mendirikan lembaga Society Education Centre (SEC) Bojonegoro sebagai salah satu model pendidikan berbasis masyarakat. Tahun 2006 hingga 2008 menjadi pendamping program pemberdayaan masyakat dalam penanggulangan kemiskinan di wilayah Kabupaten Bojonegoro. Sejak tahun 2009 memfokuskan pada program pemberdayaan sekolah dan madrasah, sebagai trainer dan konsultan pendidikan. \nPengalaman sebagai trainer diantaranya: Trainer Manajemen Berbasis Madrasah bersama LAPIS-Ausaid, Tariner Madrasah Based Performance Management (MPBM) dalam program Madrasah Education Development Program (MEDP), fasilitator Pendampingan Kompetensi Pengawas PAI pada Sekolah/Madrasah bersama Kementerian Agama RI. Selain sebagai  dosen , juga aktif di beberapa organisasi/lembaga, antara lain: Wakil Sekretaris LPTNU (Lajnah Perguruan Tinggi Nahdlatul Ulama Jawa Timur), Tim Ahli Society Education Centre Bojonegoro, dan Sekretaris Koordinatorat Perguruan Tinggi Agama Islam Swasta (Kopertais) Wilayah IV Surabaya.', '- Manajemen Pendidikan\n- Marketing Pendidikan');
