INSERT INTO `tbpegawai` VALUES (345, '195308031989031001', '2003085301', '3573010308530001', NULL, '2012-07-07', '2017-08-03', '25.467.784.2-652.000', NULL, 'PNS', 2, 'Dr. H. Abd. Kadir, MA', 35, 3578, 357822, 3578221002, NULL, 'Jl. Ciptamenanggal VI/4 Surabaya\nJl. Banyuputih no. 9 Malang, 65123', 'Jl. Banyuputih no. 9 Malang', 35, 3573, 357301, 3573011008, 65123, 1, 2, 'Laki-laki', 'Sumenep', '1953-08-03', 160, 60, 'Hitam', 'Oval', 'Sawo Matang', 'Normal', 'Normal', 3, 390, '97b26-fotoku.jpg', '03417262604', '085234056199', 'kadirqi@yahoo.co.id', 'WNI', NULL, NULL, 'U 397355', '2010-01-07', 'Indonesia', 'B', 'Membaca', 1, 151, 150, 100, 'f209d-kk_p.kadir.pdf', 33, '092100900913', 0, 0, 15, 'Abd. Kadir lahir di Sumenep, Jawa Timur, dengan menyesaikan pendidikan dasar dan menengahnya di tempat kelahirannya. Pendidikan strata satunya diselesaikan di Fakultas Tarbiyah IAIN Sunan Ampel Cabang Malang ( sekarang UIN Maliki), sedangkan strata dua dan tiganya di Program Pendidikan Pascasarjana IAIN Sunan Kalijaga (sekarang UIN Sunan Kalijaga Yogyakarta). Sedangkan short couse yang pernah diikutinya antara lain: Supervisory Manajemen di Lembaga Managemen Jawa Timur dan High Education Management di Murdock University Australia, dan beberapa workshop yang disponsori oleh Pemerintah Indonesia maupun asing. \nAktif menjadi narasumber dan instruktur dalam berbagai kegiatan seminar dan workshop internasional, nasional maupun lokal baik yang disponsori  oleh lembaga domestik maupun luar negeri. Karya tulisnya banyak dipublikasikan melalui beberapa  jurnal ilmiah, dan sebagian kecil dalam bentuk buku, seperti:  Ilmu Sosial Dasar,  Dirasah Islamiyah,  Pengantar Studi Islam, Penelitian Tindakan Kelas,  Dasar-dasar Pendidikan, Pembelajaran Tematik, Filsafat Pendidikan Islam dan lain sebagainya.\nSekarang aktif sebagai tenaga  pengajar di Fakultas Ilmu Tarbiyah dan Keguruan serta Pascasarjana Universitas Islam Negeri Sunan Ampel dan beberapa pascasarjana swasta. Sempat menjabat  sebagai ketua beberapa lembaga ad hoc di UIN  Sunan Ampel yang dibentuk atas kerjasama dengan pihak dalam  maupun luar negeri.\n', 'Pemikiran Islam');
