INSERT INTO `tbpegawai` VALUES (382, '197809282005012002', '2028097802', '3515076809780007', NULL, '2011-01-26', '2016-09-28', '35.832.787.2-617.000', NULL, 'PNS', 2, 'Umi Hanifah, M.Pd.I', 35, 3515, 351508, 3515082016, 61234, 'Perum Grand Rose Regency Blok D No. 14 Kemiri Sidoarjo', 'RT. 18 RW.05 Desa Candi Jaya Kecamatan Candi Sidoarjo', 35, 3515, 351507, 3515072012, NULL, 1, 2, 'Perempuan', 'Bojonegoro', '1978-09-28', 150, 45, 'Hitam Lurus', 'Oval', 'Cokelat', 'Lesung pipit sebelah kanan', NULL, 3, NULL, '182c9-foto-hongkong.jpg', NULL, '08123153150', 'umihanifah78@yahoo.com', 'WNI', 'hanifah@uinsby.ac.id', NULL, 'A 5285767', '2013-04-15', 'Indonesia', NULL, 'membaca', 1, 152, 150, 100, '9413b-kk---copy.jpg', 39, '1688/2028097802', 0, 0, 13, 'Nama Umi Hanifah, M.Pd.I. Lahir di Kota Bojonegoro Jawa Timur pada Tanggal 28-09-1978. Lulus MI pada tahun 1991. Lulus Mts pada tahun 1994. Lulus MA pada tahun 1997. Lulus S1 Jurusan PBA Fakultas Tarbiyah IAIN Sunan Ampel pada tahun 2001. Lulus S2 Konsentrasi Pendidikan Islam pada PPS IAIN Sunan Ampel pada tahun 2004. Menjadi Dosen (PNS) pada Fakultas Tarbiyah dan Keguruan UIN Sunan Ampel sejak tahun 2005 sampai dengan sekarang.  ', 'Agama, Ilmu Sosial, Pendidikan Islam dan Pendidikan Bahasa Arab');
INSERT INTO `tbpegawai` VALUES (383, '197001072001121001', '2007017001', '352414070170004', NULL, '2012-11-05', '2018-01-07', '26.755.879.9-645.000', NULL, 'PNS', 2, 'Dr. Hisbullah Huda, M.Ag', 35, 3515, 351513, 3515132003, NULL, ' Perumahan Griya Sepanjang Blok A/62 Kedungturi Taman Sidoarjo', 'Jl. Cinde Amo RT/RW: 004/002 Kemantren Paciran Lamongan', 35, 3524, 352414, 3524142011, 62264, 1, 2, 'Laki-laki', 'Gresik', '1970-01-07', 160, 58, 'lurus', 'bulat', 'sawo matang', 'tahi lalat di atas lais kiri', '-', 2, 394, 'afc6c-dsc_2645.jpg', NULL, '08121758799', 'hisbullahhuda70@yahoo.com.', 'WNI', NULL, NULL, NULL, NULL, NULL, 'A', 'meneliti', 1, 152, 150, 100, '3a445-kk.pdf', 39, '102101811326147', 0, 0, 12, 'Hisbullah huda dilahirkan di Gresik, pada tanggal 7 Januari 1970 dari pasangan suami-istri, Ahmad-Hj Mu\'\'inah. Ia belajar di MI, Tarbiyatus Shibyan, MTs dan MA di Tarbiyatut Tholabah sambil nyantri di pondok pesantren Raden Qosim (sekarang: Sunan Drajat) Banjaranyar Paciran lamongan, S1 di jurusan Pendidikan Bahasa Arab Fakultas Tarbiyah IAIN Sunan Ampel Surabaya (1989-1993), S2 di perguruan tinggi yang sama mengambil jurusan Pendidikan Islam (1997-1999), dan S3 di Universitas Pendidikan Indonesia (UPI) pada Program Studi Pengembangan Kurikulum (2008-2013). Setelah menyelesaikan S2, ia mengikuti program pembibitan dosen di lingkungan PTAIN Depag di Yogyakarta selama enam bulan (Juni- Nopember 2000). Pada tahun 2001 diangkat menjadi dosen di Fakultas tarbiyah IAIN Sunan Ampel Surabaya. dan sejak tahun 2015 diberi tugas tambahan sebagai sekretaris Prodi PAI di Pascasarjana UIN Sunan Ampel Surabaya.', 'Saya lebih suka menekuni bidang kurikulum dan pembelajaran Bahasa Arab.  ');
