INSERT INTO `tbpegawai` VALUES (481, '197605102007012030', '2010057602', '3515175005760009', NULL, '2013-03-09', '2017-05-10', '195211297643000', NULL, 'PNS', 2, 'R.A Vidia Gati, SE.Akt, CA, M.EI', 35, 3515, 351517, 3515172012, 61253, 'pabean asri E no 25 sedati sidoarjo', 'pabean asri E no 25 sidoarjo', 35, 3515, 351517, 3515172012, 61253, 1, 2, 'Perempuan', 'Surabaya', '1976-05-10', 153, 53, NULL, 'oval', 'kuning', NULL, NULL, 1, NULL, '46412-dscn0189.jpg', '0318683047', '081515659648', 'vidiagati@uinsby.ac.id', 'WNI', NULL, NULL, 'A9055683', '2014-09-09', 'indonesia', 'O', 'Membaca', 1, 332, 330, 300, '65bce-img037---copy.jpg', 23, '112101813321710', 0, 0, 10, 'Vidia Gati lahir di Surabaya, 10 Mei 1976. Pendidikan menengah atas diselesaikan di SMA Negeri 2 Surabaya, Pendidikan S-1 ditempuh di Fakultas Ekonomi jurusan akuntansi Universitas Airlangga Surabaya (1999), Master Ekonomi Islam di pascasarjana UIN sunan ampel surabaya dengan predikat cumlaude (2010).\nMendapat kesempatan untuk mengikuti short course di Australia pada program Introduction to Innovation and Entrepreneurship in Tertiary Education pada tahun 2011 di Sydney University dan pada tahun 2012 pada program Building Capacity-University Entrepreneurship  Education for small to medium Enterprise yang diselenggarakan AUSAID Australian Leadership Awards Fellowship (ALAF) di sydney university-Sydney Australia. \nMenjadi akuntan beregister negara dan pada tahun 2014 memperoleh gelar Chartered Accountant (CA) yaitu pengakuan sebagai akuntan profesional dari organisasi profesi Ikatan Akuntan Indonesia (IAI), yang dapat diakui oleh Professional Accountancy Organization negara lain.\n', 'Akuntansi, Akuntansi Syariah dan kajian Ekonomi Syariah');
