INSERT INTO `tbpegawai` VALUES (515, '196707271996031002', '2027076702', '3515132707670001', NULL, '2012-04-03', '2017-07-27', '34.008.782.4-603.000', NULL, 'PNS', 2, 'Drs. Achmad Yasin, M.Ag', 35, 3515, 351513, 3515131022, 61257, '1.Ngelom-Megare RT05/RW 1 Taman Sepanjang 61257\n2.Jln.Kendangsari gg. Lebar 81 Surabaya', 'Ngelom-Megare RT 05/RW 1 Taman Sepanjang 61257', 35, 3515, 351513, 3515131022, 61257, 1, 2, 'Laki-laki', 'Sidoarjo', '1967-07-27', 167, 57, 'lurus', 'oval', 'kuning langsat', 'kaca mata', NULL, 11, 386, '57efd-img00761-20140902-0456.jpg', NULL, '081332134067,083830936888', 'judulsj@gmail.com', 'WNI', NULL, NULL, 'A 4488448', '2013-01-04', 'Indonesia', 'O', 'Bulu tangkis, Volly', 1, 123, 120, 100, 'ac152-ksk-p-yasin-kecil.jpg', 27, '092100900856', 79, 21, 13, 'Saya lahir di Kelurahan Ngelom - Megare  pada hari Kamis malam Jumat, bertepatan pada jam 21.00. Seorang bidan desa yang menolong kelahiran saya dipanggil oleh masyarakat Mbok Iyah, yang nama lengkapnya Bu Muhayyah. Hari Menakjubkan itulah jatuh pada almanak yang unik dengan deretan angka 27- 07- 1967. Ayahku bernama MUCHTAR BIN SYAMSUDDIN  BIN MAS AHMAD AL QABY yang dimakamkan di komplek pondok pesantren al- Badry Tawangsari. Sedang Bundaku bernama (Muz)dalifah binti H.R. JANGKAR (KOHHAR), dan nenekku bernama h.Ummi Kultsum BINTI SAYID HASAN AL MADINAH dari Desa Bohar di Komplek masjid al Manshoer Bohar. Saya kecil mondok di ponpes Bahauddin Ngelom dengan mengaji kepada KH IMRON HAMZAH BAHAUDDIN, KH. BASUNI MANAF, KH. ABD. SYAKUR.KH.BADRUS SOLEH. Saya privat ngaji kepada PAMANDAKU KH.R. HASAN BISRI DAN KH.R AHMAD FATHONI PUTERA MBAH KHRM. ALI DI PONPES AL-BADRI SEKALIGUS SEKOLAH MI.Darul mutaalllimin Tawangsari lulus th.1882. Kemudian Sekolah SMP YPM Lulus 1985 dan melanjutkan SMU Wachid Hasyim 2 SERTA MENGAJI kepada KH.M.Hasyim Latif Sepanjang; DAN adik-adik juga sekolah di MI.Darul mutaalimin juga di YPM Semua. S1 DI FAK.Syariah   IAIN Sunan Ampel dan LULUS M.Ag di PPS. UIN Sunan Ampel Surabaya.Man jadda wa jada', 'Jalan sehat, volly Ball, Bulu Tangkis, organisasi sosial, Baca Kitab/buku dan koresponden.\nMakan yang pedas dan buah segar. fresh....');
