ahun 2012)\n-	Shifting Paradigm of the Classical Maqasid al-Shariah (The International Conference on Expressions of Islam in Resent Southeast Asias Politics, 2012).\n-	Maqasid al-Shariahsebagai Panduan Dasar dalam Melakukan Ijtihad (ISLAMICA 2014)\n-	Analysis of Hurriyyat al-Taaqqud againts an Examption Clause of a Standart Contract in Syariah BRI Brance Office of Gresik (An Analysis of Philosophy of Islamic Law) (ICOEN / the International Conference on Enterpreneurship 2015) di Universitas CIPUTRA Surabaya.\n', 'Filsafat Hukum Islam');
