INSERT INTO `tbpegawai` VALUES (541, '197708082007101004', '2008087702', '3578180808770001', NULL, '2012-07-26', '2017-08-08', '08.560.794.3-604.000', NULL, 'PNS', 2, 'Arif Ainur Rofiq, S.Sos.I, S.Pd.,M.Pd,Kons.', 35, 3578, 357818, 3578181004, 60213, 'WISMA LIDAH KULON BLOK B/92 RT.01.RW.04', 'WISMA LIDAH KULON BLOK B/92 RT.01 RW.04', 35, 3578, 357818, 3578181004, 60213, 1, 2, 'Laki-laki', 'Banyuwangi', '1977-08-08', 165, 90, 'LURUS', 'OVAL', 'KUNING LANGSAT', 'BEKAS JATUH DI ALIS', '-', 2, 375, '47ecc-arif-ainur-rofiq,s.sos.i.,s.pd.,m.pd.jpg', '081559891499', '081559891499', 'arif_konselor@yahoo.co.id', 'WNI', 'arf88.blogspot.com', NULL, 'W 227568', '2010-11-04', 'INDONESIA', 'O', 'JURNALISTIK', 1, 322, 310, 300, 'b3811-kartu-keluarga55.jpg', 11, '112101811441669', 49, 10, 12, 'Arif Ainur Rofiq dilahirkan di Banyuwangi, 08 Agustus 1977, menamatkan pendidikan pada SDN Rogojampi 1 Kecamatan Rogojampi Kabupaten  Banyuwangi  Tahun  1991, lulus Madrasah Tsanawiyah  Negeri  Kecamatan Srono Kabupaten Banyuwangi Tahun 1994, dan lulus Madrasah Aliyah Negeri  Sobo Kabupaten Banyuwangi Tahun 1997.\n\nGelar Sarjana Sosial Islam (S.Sos.I) diperoleh dari Jurusan Bimbingan dan Penyuluhan Islam Fakultas Dakwah IAIN Sunan Ampel Surabaya  pada Tahun 2002.\nSarjana Pendidikan (S.Pd) diperoleh dari Program Studi Bimbingan dan Konseling Fakultas Ilmu Pendidikan  Universitas PGRI Adi Buana Surabaya Tahun 2003, memperoleh  gelar Magister Pendidikan (M.Pd)  bidang Bimbingan dan Konseling Universitas Negeri Malang (UM)  Tahun 2007, Gelar Profesi (Kons.) di dapatkan dari perjuangannya menempuh Pendidikan Profesi Konselor selama dua semester pada Universitas Negeri Semarang (UNNES) Lulus tahun 2015 dengan predikat Cumlaude, dan saat ini tengah menyelesaikan studi S3 (Doktor) bimbingan dan konseling di Universitas Negeri Malang (UM).\n\nSejak tahun 2003 aktif mengajar di Jurusan Bimbingan Penyuluhan Islam (sekarang Bimbingan dan Konseling Islam), dosen Tidak tetap di beberapa perguruan tinggi di Surabaya dalam bidang Bimbingan dan Konseling, dan kini sebagai dosen Negeri di IAIN Sunan Ampel Surabaya mulai tahun 2009.\n\nPenulis adalah anggota Asosiasi Profesional Konseling Lingkar Asian (APCA) di Hong Kong, aktif dalam kegiatan seminar dan pelatihan, sebagai presenter dan trainer workshop Konseling Religius, Hipnotherapy Counseling, Hypnoteaching, Profesional Konselor, Multicultural Counseling, Bimbingan dan Konseling Kesehatan Reproduksi Remaja.\n\nBeberapa mata kuliah yang pernah diampuhnya antara lain : Psikologi Sosial, Psikologi Umum, Psikologi Perkembangan, Studi Kelembagaan Konseling, Konseling Karier, Problema Kerier, Perencanaan Karier, Metodologi Penelitian Kualitatif, Konseling Lintas Budaya, dan Ketrampilan Komunikasi Konseling.\n\n\n', 'Konseling');
