INSERT INTO `tbpegawai` VALUES (558, '195912261991031001', '2026126901', '3578152612590001', NULL, '2012-04-29', '2017-12-26', '092100900957', NULL, 'PNS', 2, 'Dr. Sunarto AS, MEI', 35, 3578, 357815, 3578151004, NULL, 'JL. LASEM NO 30A RT.13 RW 04', 'Jalan Lasem No. 30 A RT. 13 RW. 04 Dupak Krembangan Surabaya', 35, 3578, 357815, 3578151004, 60179, 1, 2, 'Laki-laki', 'Surabaya', '1959-12-26', 165, 56, 'jarang lurus', 'oval', 'kuning langsat', 'gigi bawah gingsul', NULL, 3, 378, 'b7e0a-apdi-id-card.jpg', '0313556092', '081357278897', 'narto_as@yahoo.com', 'WNI', '-', NULL, 'A1548063', '2011-10-19', NULL, 'O', 'membaca buku, berorganisasi', 1, 144, 140, 100, NULL, 16, '07.859.385.2-605.000', 0, 0, 13, 'Sunarto AS Lahir di Surabaya 1959. Menempuh pendidikan Dasar di MI SABILASSALAMA Lulus 1973, melanjutkan pendidikan ke ponpes Sidogiri Pasuruan mengulang ke MI MIFTACHUL ULUM sampai selesai kelas 6, tapi tidak sampai tugas, di ponpes Sidogiri ijazah MI diberikan jika selesai tugas ke luar daerah selama 1 tahun, maka ktka keluar dari ponpes Sidogiri tidak sampai mendapatkan ijzah MI, namun kemudian Sunarto AS mengikuti ujian persamaan (UPRES) SD di Krembangan dan mendapatkan ijazah. Selanjutnya melanjutkan pendidikan ke jenjang Mdrasah Tsanawiyah di ponpes Tebuireng Jombang dan mengikuti ujian ekstrane Tsanawiyah Negri di Tambak beras jombang. Melanjutkan ke Madrasah Aliyah Salafiya Tebuireng jombang dan mengikuti ujian ekstrane Aliyah Negeri Tambak beras Jombang tahun 1979/1980. masuk fakultas Dakwah jurusan PPAI IAIN SUNAN AMPEL SURABAYA tahun 1980 lulus 1987. melanjutkan S2 Ekonomi Islam PPS IAIN SUNAN AMEL SURABAYA lulus 2003. melanjutkan S3 PPS SUNAN AMPEL SURABAYA jurusan Dirosah Islamiah lulus 2012. Aktif di ASOSIASI PROFESI DAKWAH ISLAM INDONESIA (APDI) Sebagai Sekretaris Jenderal 2009-2012, sebagai Ketua V APDI 2012-2017. Sebagai Ketua Umum Ikatan Dai Area Lokalisasi MUI JawaTimur yang mengawal penutupan lokalisasi di Kota Surabaya dan 47 lokalisasi di Jawa Timur.Aktif sebagai Dai diberbagai tempat di jawa timur dan pernah berdakwah di Hong Kong dan Macao.penulis buku : 1. Etika Dakwah 2011 2. Rethorika Dakwah 2012 3. Pidato 3 bahasa 2013 4. Kiai Prostitusi 2014 5. Detik-Detik Runtuhnya Dolly 2015.', 'membabaca berbagai buku Rethorika, agama, pancasila, civic education, ekonomi,sosial politik, novel dsb. suka olahraga bersepeda joging dan traveling serta suka kuliner.');
