INSERT INTO `tbpegawai` VALUES (634, '197303032000032001', '2003037303', '3507224303730002', NULL, '2012-09-09', '2017-03-03', '47.431.292.3-628.000', NULL, 'PNS', 2, 'Prof. Dr. Hj. Zuliati Rohmah, M.Pd', 35, 3507, 350722, 3507222007, 65151, 'Jl. Tirto Mulyo VI/1B Klandungan Landungsari Dau Malang', 'Jl. Tirto Mulyo VI/1B Klandungan Landungsari Dau Malang', 35, 3507, 350722, 3507222007, 65151, 1, 2, 'Perempuan', 'Kediri', '1973-03-03', 160, 58, 'lurus', 'oval', 'sawo matang', 'tidak ada', 'tidak ada', 11, 372, 'e47e5-foto-surbun-(2).jpg', '082179968006', '082179968006', 'zettira@gmail.com', 'WNI', 'tidak ada', NULL, 'A 8507807', '2014-08-18', 'Indonesia', 'O', 'berkebun', 1, 226, 220, 200, '1a87b-kartu-keluarga.jpg', 7, '092100900989', 0, 0, 13, 'Prof. Dr. Zuliati Rohmah adalah guru besar dalam bidang kajian Bahasa Inggris di Fakultas Adab UIN Sunan Ampel Surabaya. Dia meraih gelar doktor dalam bidang Pendidikan Bahasa Inggris di Universitas Negeri Malang pada tahun  2006. Pada saat menempuh program doktornya, dia melakukan penelitian di Curtin University of Technology, Perth, Australia (2002), dan dengan beasiswa Fulbright, dia juga melaksanakan penelitian untuk disertasinya di University of Illinois at Urbana-Champaign, Amerika Serikat (2003). Pada tahun 2007, dia mengikuti program In-service Certificate in English Language Teaching (ICELT) dari  University of Cambridge selama 6 bulan. Sejak saat itu, dia aktif memberikan training bagi guru-guru di berbagai tempat di Indonesia, terutama melalui program LAPIS-ELTIS dan the British Council. Sebagai editor dari jurnal Teaching English as A Foreign Language in Indonesia (TEFLIN), dia juga telah mempresentasikan makalahnya dalam berbagai forum tingkat nasional dan internasional. Makalahnya juga telah terbit di berbagai jurnal bidang pembelajaran bahasa Inggris baik tingkat nasional maupun internasional. Pada tahun 2011-2012, dia mendapatkan kesempatan untuk mengembangkan leadership and managerial skills-nya di Amerika Serikat melalui Humphrey Fellowship. Saat ini, dia medapat tugas untuk menjadi Ketua Dewa Penyunting Jurnal Nobel yang diterbbitkan oleh Fakultas Adab da Humaniora UIN Sunan Ampel Surabaya.\n\n\n', 'Discourse Analysis, educational linguistics, teacher training. ');
