INSERT INTO `tbpegawai` VALUES (647, '197106072003121001', '2007067102', '3515060706710001', NULL, '2013-03-12', '2017-06-07', '77-823660-4-617-000', NULL, 'PNS', 2, 'Endratno Pilih Swasono, M.Pd', 35, 3515, 351502, 3515022018, 61262, 'Perumahan Grand Indraprasta Blok C.5 No.09  Desa Simogirang kecamatan Prambon Kabupaten Sidoarjo', 'Perumahan Grand Indraprasta Blok C.5 No.09 Desa Simogirang kecamatan Prambon Kabupaten Sidoarjo', 35, 3515, 351502, 3515022018, 61262, 1, 2, 'Laki-laki', 'Nganjuk', '1971-06-07', 160, 57, 'Ikal', 'Oval', 'Sawo matang', '-ada tahi lalat di pipi kanan', '-', 2, 372, '8a9ca-photo-endratno.jpg', '081553436197', '081553436197', 'endratno007@uinsby.ac.id/ endratno007@yahoo.co.id', 'WNI', 'endratno007@yahoo.co.id/endratno007@yahoo.co.id', NULL, 'A0374026', '2011-05-06', 'INDONESIA', 'B', 'Olah raga', 1, 226, 220, 200, '8eef0-img_20150820_0001copi.jpg', 7, '102101812266224', 0, 0, 12, 'Endratno Pilih Swasono lahir di Nganjuk 7 juni 1971.Pendidikan dasar, menengah, dan atas di selesaikan di Nganjuk.Setelah itu dia melanjutkan sarjana S1 di Surabaya, dan gelar Magister S2 di tempuh di Universitas Negeri Surabaya atau UNESA.  Dia menjabat sebagai Ketua Program Studi Sastra Inggris periode Tahun 2010 sampai dengan 2014. selain mengajar di Fakultas Adab dan Humaniora di prodi Sastra Inggris UIN Sunan Ampel juga melakukan aktivitas sebagai peneliti.Pada Tahun 2011 telah melakukan studi banding kurikulum (curriculum Development) di Canbera University, di lanjutkan tahun 2012 melakukan short course entrepreneurship di Sydney Uni. Pada tahun 2014 melakukan short course untuk pengabdian masyarakat tentang (Asset Based Community Development/ABCD dan Learning Organisation and Change/LOC) di Coady Institute Canada.  ', 'Pengembangan Pengajaran dan Penelitian di bidang Bahasa dan Sastra Inggris.');
