INSERT INTO `tbpegawai` VALUES (661, '195206171981031002', '2017065201', '3578021706520002', NULL, '2012-04-30', '2017-06-17', '77-823661-2-609-000', NULL, 'PNS', 2, 'Prof. Dr. H. ALI MUFRODI, MA', 35, 3578, 357820, 3578201001, 60283, 'GRAHA SUNAN AMPEL Q-14 RT.004/005 WIYUNG SURABAYA', 'GRAHA SUNAN AMPEL Q-14 RT.004/005 WIYUNG SURABAYA', 35, 3578, 357820, 3578201001, 60283, 1, 2, 'Laki-laki', 'BLORA', '1952-06-17', 160, 73, 'IKAL', 'BULAT', 'SAWO MATANG', NULL, NULL, 4, 373, 'ecaa5-195206171981031002.jpg', '031755364', '082141739859', 'ali.mfd52@gmail.com', 'WNI', NULL, NULL, 'A 528912', '2013-04-15', 'Indonesia', 'B', 'BULUTANGKIS', 1, 131, 130, 200, 'b8a4f-kk-wiyung_.pdf', 8, '09210180219', 4, 96, 17, 'Ali Mufrodi, lahir di Randublatung Blora.Sekolah dasar ditempuhnya di desanya, lalu ke nyantri Pondok Modern Gontor Ponorogo, tamat tahun 1972. Meneruskan kuliah di Fakultas Adab IAIN Sunan Ampel, tamat 1980.Melanjutkan ke S2 dan S3 di UIN Syarif Hidayatullah Jakarta, tamat doktor tahun 1994. Menjadi Dekan Fakultas Adab tahun 1997-2001, Asisten Direktur Pascasarjana, tahun 2003-2009, dan wakil Rektor III bidang kemahasiswaan alumni dan kerjasama, 2012-kini/2015. ', 'Sejarah Kebudayaan Islam, khususnya kawasan Timur Tengah dan Asia Tenggara.');
