INSERT INTO `tbpegawai` VALUES (677, '197211292000031001', '2029117202', '3515132911720003', NULL, '2012-06-28', '2017-06-29', '47.431.286.5-603.000', NULL, NULL, 2, 'Muhammad Khodafi, M.Si', 35, 3515, 351513, 3515132016, NULL, 'Tawangsari Permai C-19 Dusun Losari Rt 01/RW 01 Kletek Taman Sidoarjo', 'Dusun Losari Rt 01/RW 01 Kletek Taman Sidoarjo', 35, 3515, 351513, 3515132016, NULL, 1, 2, 'Laki-laki', 'Lumajang', '1972-11-29', 173, 63, 'hitam', 'oval', 'coklat', 'berkacamata', NULL, 2, 373, '414bc-foto0001.jpg', '+62317881055', '+6281330130835', 'mkhod4fi@gmail.com', 'WNI', NULL, NULL, 'S273905', '2018-12-27', 'Indonesia', 'O', 'baca buku', 1, 383, 380, 300, '0b95c-kartukeluarga.pdf', 8, NULL, 0, 0, 11, 'Lahir di Lumajang 29 Nopember 1972, mendapatkan pendidikan dasar di Madrasah Ibtida\'\'iyah Al Ghozali Lumajang dan Melanjutkan ke jenjang menangah pertama di Tsanawiyah Wahid Hasyim Lumajang, kemudian melanjutkan ke jenjang pendidikan menengah atas di SMAN 1 Lumajang. Setalah lulus sempat mengikuti pendidikan pesantren di Ploso Kediri, sebelum kemudian mengambil pendidikan S1 di Fisip Universitas Airlangga Surabaya pada Jurusan Antropologi. Pernah mengabdi sebagai pengelola majalah SANTRI di PP Rabitha Ma\'\'ahid Islamiyah PBNU mulai tahun 1996-2002. Dalam studi S1, S2 dan S3 selalu berkonsentrasi pada studi antropologi Agama. ', 'Antropologi Agama, Sosiologi, Studi Gender dan Media, serta Cultural Studies.');
