INSERT INTO `tbpegawai` VALUES (706, '198702082014032003', NULL, '3578254802870001', NULL, '2012-04-28', '2017-02-08', '465071363615000', NULL, 'PNS', 2, 'Nita Yalina, S.Kom., M.MT', 35, 3578, 357825, 3578251003, 60293, 'Rungkut Barata III No.17', 'Rungkut Barata III No.17', 35, 3578, 357825, 3578251003, 60293, 1, 2, 'Perempuan', 'Banjarmasin', '1987-02-08', 159, 59, 'lurus', 'bulat', 'putih', '\'\'', '-', 1, NULL, '43686-edit.jpg', '0318700044', '081938406662', 'nitayalina@uinsby.ac.id', 'WNI', NULL, NULL, NULL, '2014-09-25', 'Indonesia', 'A', 'membaca', 1, 813, 640, 500, '0d22b-kk-keluarga-ridho-dimas-librihananto.jpg', 60, NULL, 0, 0, 10, 'Nita Yalina, S.Kom, M.MT atau yang akrab disapa dengan Nita ini dilahirkan pada tanggal 8 Februari 1987. Menempuh pendidikan sarjana di STIKOM Surabaya dengan jurusan Sistem Informasi dan melanjutkan pendidikan magister di Institute Teknologi Sepuluh November dengan jurusan Manajemen Teknologi  Informasi.\nNita aktif berkecimpung dalam dunia pengembangan aplikasi sistem informasi dan juga sebagai tenaga pengajar. Pernah bekerja pada konsultan IT selama beberapa tahun dan mengajar di berbagai Universitas di Surabaya.\nSaat ini, aktif sebagai tenaga pengajar tetap di Universitas Islam Negeri  Sunan Ampel Surabaya sejak tahun 2014.', 'Pengembangan dan Implementasi Sistem Informasi');
