INSERT INTO `tbpegawai` VALUES (721, '198202242014031001', NULL, '3573052402820003', NULL, '2012-07-04', '2017-02-24', '46.540.141.2-652.000', NULL, 'PNS', 2, 'Parmo, MT', 35, 3525, 352510, 3525102012, NULL, 'Jl. Tambak Ragen Dusun Nambi', 'Jl. Tlogo Agung I No. 6B', 35, 3573, 357305, 3573051003, 65144, 1, 2, 'Laki-laki', 'Bojonegoro', '1982-02-24', 165, 72, 'Lurus', 'Oval', 'Sawo matang', 'Tahi lalat dibawah bibir sebelah kanan', '-', 1, 412, '8fcf7-foto-parmo.jpg', '0313944196', '081233263536/081230363478', 'parmo_99@yahoo.com/parmo_99@uinsby.ac.id', 'WNI', NULL, NULL, NULL, NULL, NULL, 'B', 'Bulutangkis', NULL, 831, 810, 800, '9a216-ksk.jpg', 60, '', 0, 0, 18, 'Parmo, S.T, M.T. Lahir di Bojonegoro, 24 Februari 1982, dari pasangan H. Widji Rosidin dan Hj. Yatmi, meraih gelar Ahli Madya (A.Md) Teknik Sipil dan Bangunan pada Prodi D-III Teknik Sipil Universitas Negeri Malang tahun 2002. Sarjana Teknik (ST) dari Jurusan Teknik Sipil Universitas Widyagama Malang tahun 2007. Ia menambah pengetahuannya dengan memperoleh gelar Magister Teknik (MT) dari Jurusan Teknik Sipil Konsentrasi Rekayasa Struktur Universitas Brawijaya Malang tahun 2013. Karier profesional sebagai Ahli Teknik Bangunan Gedung - Madya diperoleh dari Lembaga Pengembangan Jasa Kostruksi (LPJK) melalui Himpunan Ahli Konstruksi Indonesia (HAKI). Pengalaman kerja dimulai sebagai Tim Teknis Universitas Negeri Malang sejak tahun 2003 sampai 2011 kemudian diangkat sebagai Sekretaris Tim Teknis tahun 2012 sampai 2013. Ia pun menyebarkan pengetahuan dengan mengajar pada Prodi Arsitektur UINSA Surabaya sebagai pengampu mata kuliah: Mekanika Teknik, Struktur dan Konstruksi Bangunan I, dan Strukur dan Konstruksi Bangunan II.', 'Structural and Construction Engineering, Earthquake Building Resistant Structure and Community Development in Islamic & Technic Perspective');
