INSERT INTO `tbpegawai` VALUES (761, '201409002', NULL, '3515145907890002', NULL, '2012-04-06', '2017-07-19', '708901442603000', NULL, 'Non PNS', 2, 'Risa Purnamasari, S. Si, M. Si  ', 35, 3515, 351514, 3515142017, 62158, 'griya bhayangkara blok N-3', 'griya bhayangkara blok N-3', 35, 3515, 351514, 3515142017, 62158, 1, 2, 'Perempuan', 'surabaya', '1989-07-19', 158, 52, 'lurus', 'oval', 'sawo matang', NULL, 'mata minus dan silinder', 11, 414, 'd96c8-resize-50%.jpg', NULL, '082143312741', 'risa.purnamasari89@yahoo.co.id', 'WNI', NULL, NULL, NULL, NULL, NULL, 'A', 'traveling dan kuliner', NULL, 511, 510, 500, '9fb9f-piagam--summa-cumlaude.jpg', 62, '', 0, 0, NULL, 'saya lahir di surabaya, tanggal 19 juli 1989, pada umur 3 tahun pendidikan pertama saya tempuh di taman kanak-kanak kutilang surabaya, yang berada di daerah sawahan, kemudian pada umur 5 tahun saya masuk sekolah dasar di SDN TEMBOK DUKUH 1 surabaya yang saya tempuh selama 6 tahun, setelah itu pada tahun 2000 saya masuk ke sekolah menengah pertama di SLTPN 1 surabaya dan lulus tahun 2003, kemudian saya melanjutkan ke sekolah menengah atas di SMAN 9 SURABAYA dan lulus tahun 2006, kemudian pada tahun 2006 saya melanjutkan pendidikan ke universitas, yaitu di UNIVERSITAS AIRLANGGA SURABAYA, fakultas sains dan teknologi, program studi S1 BIOLOGI, yang saya tempuh 8 semester dan lulus ditahun 2010, kemudian saya langsusng melanjutkan pendidikan ke jenjang yang lebih tinggi yaitu mengikuti prpgram magister di UNIVERSITAS AIRLANGGA SURABAYA, fakultas sains dan teknologi, prpgram studi S2 biologi, yang saya tempuh selama 3 semester, dan saya lulus di awal tahun 2012, kemudian saya bekerja menjadi Dosen di Universitas nahdlatul ulama surabaya, sebagai dosen fakultas kedokteran, program studi D4 analis kesehatan selama 1tahun, kemudian saya hijrah ke menjadi dosen di UNiVERSITAS ISLAM NEGERI SUNAN AMPEL SURABAYA pada tahun 2014 di fakultas sains dan teknologi, program studi S1 Biologi', 'bidang mimat yang saya tekuni yaitu Biologi perkembangan dan zoologi');
