INSERT INTO `tbpegawai` VALUES (771, '201409012', NULL, '3578042302850002', NULL, '2012-07-01', '2017-02-23', '59.234.876.7-609.000', NULL, 'Non PNS', 1, 'Teguh Panotogomo, SE ', 35, 3525, 352515, 3525152012, NULL, 'Jl. Biduri Pandan 2.2 No. 46 Komplek Perumnas Kota Baru Driyorejo Kabupaten Gresik  ', 'Banyu Urip Wetan 4 No. 12 RT 09 RW 07 Kota Surabaya', 35, 3578, 357806, 3578061003, 60254, 1, 2, 'Laki-laki', 'Surabaya', '1985-02-23', 162, 60, 'Lurus Hitam', 'Bundar', 'Sawo Matang', NULL, NULL, NULL, 296, NULL, '78118880', '087854563280', 'teguh23jaya@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'O', 'Renang, Sepak Bola', NULL, NULL, NULL, NULL, '6e295-kk.pdf', 71, NULL, 0, 0, 19, 'Nama lengkap saya adalah Teguh Panotogomo. Nama saya tersebut memiliki arti \"Seorang Lelaki yang memiliki pendirian yang kuat dan bisa menata kehidupan agamanya\". Saya lahir di kota Surabaya tepatnya di daerah Ngagel. Saya lahir di lingkungan keluarga yang terdidik dan kental akan prinsip keagamaan islam. Kedua orang tua saya adalah seorang pegawai PNS di Kementerian PU Jawa Timur. Semasa kecil saya tergolong anak yang penurut akan perintah orang tua. Selain itu juga orang tua berharap kelak kapada saya untuk menjadi seorang yang berhasil dan membanggakan keduanya. Singkat cerita saya lulus pendidikan sarjana tahun 2007 di Universitas Negeri Surabaya dengan gelar Sarjana Ekonomi. Alhamdulillah saya bisa menempuh pendidikan dengan tepat waktu selama 4 tahun dan mendapat nilai IPK 3,05 dengan predikat \"sangat memuaskan\". Setelah lulus kuliah tersebut maka saya memulai karier kerja di perbankan. Tepatnya pada tahun 2008 saya kerja sebagai teller di sebuah bank swasta. Saya bekerja di bidang perbankan selama 6 tahun sampai dengan jabatan terakhir saya sebagai supervisor teller. Dan saat ini saya diterima kerja sebagai Pegawai Tetap BLU Non PNS di Satker UIN Sunan Ampel Surabaya.   ', 'Saya memiliki minat kerja di bidang Keuangan. Selain itu juga saya senang bekerja dalam teamwork. ');
