INSERT INTO `tbpegawai` VALUES (839, '197909272014032001', '2027097901', '3524256709790001', NULL, '2013-02-14', '2018-09-27', '54.609.717.1-645.000', NULL, 'PNS', 2, 'Dwi Rolliawati, MT', 35, 3524, 352425, 3524252016, NULL, 'rande RT 004/ RW 001', 'rande RT 004/ RW 001', 35, 3524, 352425, 3524252016, NULL, 1, 2, 'Perempuan', 'Surabaya', '1979-09-27', 165, 60, 'HITAM', 'OVAL', 'COKLAT', NULL, NULL, 1, 412, '27fb2-lia.jpg', NULL, '081 6513299', 'dwi-roll@uinsby.ac.id', 'WNI', NULL, NULL, 'B2371010', '2015-11-09', 'INDONESIA', 'O', NULL, NULL, 813, 810, 800, 'c2367-kk---dwi.pdf', 60, '12107100813824', 0, 0, 2, 'Dwi Rolliawati dilahirkan di Surabaya, 27 September 1979 dan terjun didunia pendidikan tinggi sejak tahun 2005. Tahun 2003 lulus pendidikan S1 Teknik Informatika di ITATS. Tahun 2009 mendapat beasiswa kuliah S2  di Teknik Elektro ITS, bidang keahlian Game Technology. Pernah mengajar sebagai dosen luar biasa di ITATS, Universitas Widya Kartika dan Universitas DR.Soetomo. Tahun 2009/2010 bergabung di Universitas Narotama sebagai dosen tetap sampai tahun 2014. Mata kuliah yang pernah diampu selama ini adalah keamanan komputer, kecerdasan buatan, sistem pakar, pemrograman berorientasi obyek, dan proyek game. ', 'Computer science\nGame technology\n');
INSERT INTO `tbpegawai` VALUES (855, '198706242014032001', NULL, '3603286406870008', NULL, '2013-04-17', '2018-06-24', '70.956.952.9-451.000', NULL, 'PNS', 2, 'Esti Tyastirin, M. KM', 35, 3515, 351514, 3515142013, NULL, 'Perumahan Aloha Blok H5 No.13 RT 44 RW 9', 'Jl Korma IV No, 11 RT 03 RW 04 Islamic Village', 36, 3671, 367107, 3671071001, NULL, 1, 1, 'Perempuan', 'Bandung', '1987-06-24', 150, 48, 'hitam', 'bulat', 'sawo matang', NULL, 'tidak ada', 1, 409, 'ba80b-198706242014032001.jpg', '02154203456', '081286898878', 'estityastirin@yahoo.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'B', NULL, NULL, 562, 560, 500, '1507e-kk.jpg', 57, NULL, 0, 0, 10, 'Saya, Esti Tyastirin. Merupakan anak kedua dari 2 bersaudara. Saya keturunan Jawa, namun lahir di Bandung pada 1987. Menempuh pendidikan formal (SD-SMA) di Serang-Banten. Pada tahun 2005 melanjutkan studi sarjana sekaligus magister di UI-Depok.', 'Kesehatan Masyarakat');
INSERT INTO `tbpegawai` VALUES (856, '198805182014032002', NULL, '3312135805880002', NULL, '2012-09-21', '2017-05-18', '708486030532000', NULL, NULL, 2, 'Mei Lina Ftri Kumalasari, SST., M. Kes', 35, 3578, 357802, 3578021003, NULL, 'Margorejo Tangsi IV No 24 Margorejo Surabaya', 'Sanggrahan Rt 02 Rw 08 Ngadirojo', 33, 3312, 331213, 3312132006, 57681, 1, 1, 'Perempuan', 'Wonogiri', '1988-05-18', 158, 55, 'bergelombang', 'bulat', 'sawo matang', NULL, NULL, 1, NULL, '197ed-mei-lina-fitri-k-sst.jpg', NULL, '082226010045', 'meilina_fitri@uinsby.ac.id', 'WNI', NULL, NULL, NULL, NULL, NULL, 'B', 'Menulis, Membaca, Traveling', NULL, 564, 560, 500, NULL, 57, NULL, 0, 0, 18, 'Nama Mei Lina Fitri Kumalasari, SST., M.Kes. Anak dari pasangan suami istri Joko Sudibyo dan Siti Hajar serta berasal dari Wonogiri Jawa Tengah. Menyelesaikan pendidikan DIV Kebidanan UNS pada tahun 2010 dan S2 Kedokteran Keluarga UNS pada tahun 2013.  ', 'Kesehatan');
INSERT INTO `tbpegawai` VALUES (857, '198612212014031001', '-', '3524252112860001', NULL, '2015-07-07', '2020-12-21', '369727037645000', NULL, 'PNS', 2, 'Saiku Rokhim, M.KKK', 35, 3525, 352515, 3525152004, 61177, 'Perum. Graha Mutiara Indah Blok AA7 No.12', 'Dsn. Palrejo RT.03 RW.02', 35, 3517, 351711, 3517112003, 61483, 1, 2, 'Laki-laki', 'Lamongan', '1986-12-21', 167, 45, 'Bergelombang', 'Oval', 'Sawo matang', '-', '-', 1, 409, 'ed205-foto.jpg', '085649046067', '085649046067', 'saiku_rokhim_avicenna@yahoo.com', 'WNI', '-', NULL, '-', NULL, '-', 'O', 'Membuat karya/kerajinan', NULL, 511, 510, 500, '70f55-ksk.pdf', 57, '-', 0, 0, 18, 'Nama lengkap Saiku Rokhim, M.KKK. Lahir di Lamongan pada 21 Desember 1986. Dosen Fakultas Sains dan Teknologi UIN Sunan Ampel Surabaya. Saat ini bertempat tinggal di Perum Graha Mutiara Indah AA7/12 Desa Mojosarirejo Kecamatan Driyorejo Gresik. Alamat email : saiku_rokhim_avicenna@yahoo.com.\nPendidikan dasar diselesaikan di SD Negeri 2 Srirande, Lamongan (1999). Pendidikan menengah pertama di SLTP Negeri 2 Deket, Lamongan (2002). Pendidikan menengah atas di MA Negeri Lamongan (2005). Pendidikan tinggi diploma pada Program Studi D3 Hiperkes dan Keselamatan kerja Fakultas Kesehatan Masyarakat Universitas Airlangga (2008). S-1 di Fakultas Kesehatan Masyarakat Universitas Airlangga (2010). S-2 juga di Fakultas Kesehatan Masyarakat Universitas Airlangga (2012).\nKarya penelitian antara lain; Keluhan Subyektif pada Saluran Pernapasan Tenaga Kerja Pengelasan (2008/Tugas Akhir). Efektivitas Penggunaan Local Exhaust Ventilation (LEV) yang Dirancang Secara Sederhana (2010/Skripsi). Pengolahan air menggunakan teknik kantong bertingkat (2010/Karya inovatif). Rancangan pengolahan air limbah pada perumahan (2010/Karya inovatif). Risk Assessment Terhadap Paparan Debu (2011/Residensi). Analisis dan Perancangan Macromedia Sarana Emergency Exit pada Bangunan gedung (2012/Tesis).  \nDari hobi membuat karya, menghasilkan beberapa karya sains yang dipamerkan di lokal Surabaya dan diikutsertakan dalam lomba nasional. Penghargaan yang pernah diraih; DUTA AIR : Honorable Award Piala Gubernur Jawa Timur 2010.', 'Kesehatan dan Keselamatan Kerja');
