INSERT INTO `tbpegawai` VALUES (860, '197902072014032001', NULL, '3523034702790002', NULL, '2015-06-30', '2020-02-07', '444302117648000', NULL, 'PNS', 2, 'Dwi Rukma Santi, S. ST., M. Kes', 35, 3523, 352315, 3523151015, 62335, 'Perum Gedongombo Baru Blok Q-24', 'Jl. Rondokuning No.309 RT.03/RW/06', 35, 3523, 352303, NULL, 62364, 1, 2, 'Perempuan', 'Tuban', '1979-02-07', 157, 69, 'Hitam', 'Bulat', 'Sawo matang', '-', 'tidak ada', 1, NULL, '0c067-foto-dwi-rukma-santi.jpg', NULL, '085648937714', 'dwirukmasanty@uinsby.ac.id/ dwirsanty@gmail.com / antycantik@yahoo.co.id', 'WNI', NULL, NULL, '-', NULL, '-', 'B', 'Membaca', NULL, 564, 560, 500, 'c3cef-kk.pdf', 57, '', 0, 0, 10, 'Nama Dwi Rukma Santi, Lahir di Kota Tuban pada tanggal 7 Februari 1979 anak dari pasangan Ibu Rumijati dan Bapak Paryadi. Pernah menempuh pendidikan Sekolah Perawat Kesehatan (SPK) Depkes Tuban (lulus 1997), melanjutkan studi di Akademi Kebidanan Siti Khodijah Sidoarjo (lulus 2002), D-4 Kebidanan Bidan Pendidik di Fakultas Kedokteran Universitas Padjadjaran Bandung (lulus 2005)dan S2 Kesehatan Masyarakat Konsentrasi Kesehatan Ibu dan anak di Universitas Diponegoro Semarang (lulus 2012).\nRiwayat Pekerjaan :\n- Pernah bekerja sebagai perawat di RB.Ratna Pare Kediri (1997 s/d 1999)\n- Pernah bekerja sebagai bidan di RSB Kirana Sepanjang Sidoarjo (2002 s/d 2003)\n- Pernah bekerja sebagai asisten dosen di Prodi Kebidanan Poltekes Majapahit Mojokerto (2003 s/d 2004)\n- Pernah bekerja menjadi dosen di Akademi Kebidanan Nahdlatul Ulama Tuban (2005 s/d 2013', 'Kesehatan Ibu dan Anak');
INSERT INTO `tbpegawai` VALUES (861, '198107252014031002', NULL, '3521122507810004', NULL, '2012-08-27', '2015-07-25', '34.022.616.6-521', NULL, 'PNS', 2, 'Misbakhul Munir, M. Kes', 35, 3578, 357802, 1006, NULL, 'Jemur Ngawinan Gang I', 'Perum Griya Satria Indah 2 Gang Sa\'adullah Blok F no 2 Kalisari Sumampir Purwokerto', 33, 3302, 330227, 3302271003, NULL, 1, 2, 'Laki-laki', 'Ngawi', '1981-07-25', 160, 157, 'hitam lurus', 'oval', 'sawo matang', 'berkacamata', '-', 1, 409, '435b3-copy-(3)-of-dsc_9567-merah.jpg', NULL, '081359473812', 'misbakhul_munir@uinsby.ac.id', 'WNI', NULL, NULL, NULL, NULL, NULL, 'B', 'membaca', NULL, 562, 560, 500, '07768-kk.pdf', 57, NULL, 0, 0, 10, 'Misbakhul Munir, S.Si., M.Kes. Lahir di Ngawi 25 Juli 1981. Menyelesaikan program Sarjana di Fakultas Biologi Universitas Jenderal Soedirman (Unsoed) Tahun 2004. Tahun 2005 Melanjutkan Program Magister di Fakultas Kedokteran Universitas Gadjah Mada Minat utama Ilmu Kesehatan Tropis hingga Tahun 2007. Tahun 2011 hingga awal 2014 mengabdi di Jurusan Farmasi Unsoed sebelum akhirnya memulai karir sebagai Dosen di UIN Sunan Ampel Surabaya terhitung Maret 2014 hingga saat ini.Sebagai angkatan perintis, Oktober 2014 dipercaya sebagai Pgs Ketua Jurusan Sains yang membawahi Program Studi Matematika, Biologi dan Ilmu Kelautan.Mengajar Biologi sel, Mikrobiologi, Kesehatan Me, ntal, Genetika, Biologi Molekuler, dll.', 'Biologi dan Kesehatan');
