INSERT INTO `tbpegawai` VALUES (869, '198103042014031001', '2004038102', '6303050403810006', '03c3c-ktp-frontside.jpg', '2013-03-06', '2019-03-04', '16.115.301.0.732.000', '9387a-npwp.pdf', 'PNS', 2, 'Muhamad Ratodi, M. Kes', 35, 3578, 357802, 1006, 0, 'Jl Jemur Ngawinan no 42 Surabaya', 'Jl Kenanga Komplek Barakat Sekumpul No 255 ', 63, 6303, 630305, 6303052052, 70651, 1, 2, 'Laki-laki', 'Jakarta', '1981-03-04', 160, 73, 'ikal', 'oval', 'coklat', NULL, '-', 1, NULL, 'c8815-s200_muhamad.ratodi.jpg', '081348881023', '081348881023', 'mratodi@uinsby.ac.id', 'WNI', 'www.mratodi.top', '0dfdf-scan_akta_todi.pdf', '000-0000', NULL, 'Republik Indonesia', 'O', 'Fotografi', NULL, 562, 560, 500, '27dc4-kk.jpg', 57, 'xxxxxxx', 0, 0, 10, 'Dilahirkan di kota Jakarta, putra sulung dari 3 bersaudara ini menghabiskan sebagian besar masa kecil dan pendidikan menengahnya di Kota Bekasi, Jawa Barat. Pada tahun 2003 berhasil menyelesaikan pendidikan sarjananya di Universitas Pancasila Jakarta Jurusan <b>Arsitektur</b> dilanjutkan Pasca Sarjana di Jurusan Ilmu Kesehatan Masyarakat Universitas Airlangga Surabaya (2011) dengan peminatan <b>Promosi Kesehatan dan Ilmu Perilaku</b> </br></br> Dua prinsip utamanya adalah \"Jangan Menjadi Katak Dalam Tempurung\" dan Never Stop to Learn. </br></br>Find me at\n: </br><b>Academia</b> >> https://independent.academia.edu/muhamadratodi </br><b>Twitter</b> >> @todi_licious </br><b>Instagram</b> >> @mratodi', 'Kesehatan Urban\n</br>Psikologi & Perilaku Lingkungan Binaan');
INSERT INTO `tbpegawai` VALUES (870, '198710052014032003', NULL, '5206024510891006', NULL, '2015-01-26', '2020-10-05', '707530390912000', NULL, 'PNS', 2, 'Sarita Oktorina, M. Kes', 35, 3578, 357802, 3578021005, 60236, 'siwalankerto timur 3 no 26', 'siwalankerto timur 3 no 26', 35, 3578, 357802, 3578021005, 60236, 1, 2, 'Perempuan', 'Ujung Pandang', '1987-10-05', 145, 42, 'Hitam', 'Bulat', NULL, NULL, NULL, 1, 409, 'ac3ba-198710052014032003.jpg', NULL, '082341243509', 'saritaoktorina@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'B', 'membaca', NULL, 562, 560, 500, NULL, 57, NULL, 0, 0, 18, 'Lahir di Makassar 5 Oktober 1987. Anak Pertama dari empat bersaudara. Mendapat gelar sarjana pada tahun 2010, pada STIK Tamalatea Makassar. Kemudian menamatkan gelar Magister pada tahun 2012 pada Universitas Hasanuddin Makassar.', ' 1. Gizi Kesmas\n2. Kesehatan ');
