INSERT INTO `tbpegawai` VALUES (965, '198505112015031003', NULL, '3526011105850003', NULL, '2012-09-08', '2017-05-11', '45.441.742.9-644.000', NULL, 'PNS', 2, 'AULIYA RIDWAN, M.Pd.I', 35, 3515, 351518, 3515182001, NULL, 'Jl. Kenongosari 49b', 'Jl. KH. M. Toha I/76 Bangkalan', 35, 3526, 352601, 3526011002, 69116, 1, 2, 'Laki-laki', 'Bangkalan', '1985-05-11', 167, 90, 'Hitam', 'Kotak', 'Sawo Matang', NULL, NULL, 11, 387, 'ad189-3x4.jpg', NULL, '+6281233074347', 'auliya.ridwan@yahoo.com', 'WNI', NULL, NULL, 'A2756175', '2012-05-04', 'Indonesia', 'O', 'Bersepeda', NULL, 151, 150, 100, NULL, 28, NULL, 0, 0, 18, 'My career has led me to specialize increasingly in the issues of Islamic education in Indonesia, particularly from sociological and anthropological perspectives. This specialization was developed from my experience in carrying out several research projects on the previously mentioned areas in which I was dealing with data collection and analysis. I much concentrated on the academic discourses when I got a teaching position in IAIN Sunan Ampel Surabaya (2009-now). I was rewarded a scholarship called Human and Institutional Capacity Development (HICD) from the U.S. government in 2010 and I began my study in the U.S. in 2012. My cosmopolitan background of the Indonesian Islam was formed in the town where I was born, Bangkalan, and the campus where I took my first two degrees, IAIN Sunan Ampel. Furthermore, another degree I pursued in the U.S. provided me developmental perspective in education. The combination between Islamic education studies and development studies in education is highly beneficial in my career, particularly in terms of working through current Islamic education vis--vis societal development issues in academic discourse.', '-	Islamic education and sociological analysis.\n-	Qualitative research methods and data analysis.\n-	Applied regression for social science.\n-	Program evaluation designs.\n');
INSERT INTO `tbpegawai` VALUES (966, '198211132015032003', NULL, '3578095311820002', NULL, '2013-03-21', '2018-11-13', '72.150.523.8-606.000', NULL, 'PNS', 2, 'USWATUN CHASANAH, M.Pd.I', 35, 3578, 357809, 3578091001, 60111, 'KEPUTIH GANG I/9 RT.03 RW.03 SUKOLILO SURABAYA', 'Keputih Gg. I No. 9 RT.3 RW.03 Sukolilo Surabaya', 35, 3578, 357809, 3578091001, 60111, 1, 2, 'Perempuan', 'Surabaya', '1982-11-13', 155, 50, 'Hitam Lurus', 'Oval', 'Sawo matang', NULL, 'Tidak ada', 11, 387, '8d194-image5327.jpg', NULL, '087852202647', 'uswatun_chasanah9@yahoo.com', 'WNI', NULL, NULL, NULL, NULL, NULL, NULL, 'Memasak', NULL, 151, 150, 100, 'd31b8-image5320.jpg', 28, NULL, 0, 0, 18, 'Saya terlahir di Surabaya tanggal 13 November 1982 dari pasangan Bapak Subandi dan Ibu Nafsiyah. Masa pendidikan Sekolah Dasar saya tempuh di Lembaga Pendidikan Islam Tarbiyatul Aulad (SD YAPITA SURABAYA)lulus pada tahun 1995. Sekolah Menengah Pertama saya tempuh di Lembaga Pendidikan Islam Tarbiyatul Aulad (SMP YAPITA SURABAYA) lulus tahun 1998, dan Sekolah Menengah Pertama saya tempuh di MA Pondok Pesantren Wali Songo Ngabar Ponorogo lulus pada tahun 2002. Setelah menempuh pendidikan menengah,saya menempuh masa pengabdian selama 1 tahun (2002-2003)di KMI Pondok pesantren Al-Kautsar Al-Gontory Aiknyambuk Aikmel lombok Timur NTB.\nPendidikan Tinggi (S1) saya tempuh pada tahun 2004-2008 di Fakultas Tarbiyah Jurusan Pendidikan Agama Islam Institut Agama Islam Negeri Sunan Ampel Surabaya dan Pendidikan S2 saya tempuh di Kosentrasi Pendidikan Islam Institut Agama Islam Negeri Sunan Ampel Surabaya lulus pada tahun 2011. \nPada tahun 2011 saya mulai mengabdi menjadi Dosen Luar Biasa di UIN Sunan Ampel Surabaya sampai dengan tahun 2015. Pada tahun 2015 sekitar Bulan September, saya mendaftar CPNS dan formasi yang saya pilih adalah Calon Dosen Pengembangan Kurikulum, alhamdulillah diterima dan pada tanggal 1Juli saya mendapatakan amanah untuk memulai masa kerja saya sebagai CPNS Dosen Pengembangan kurikulum di UIN Sunan Ampel Surabaya.', 'Menulis dan Memasak');
INSERT INTO `tbpegawai` VALUES (967, '198111032015032003', NULL, '3502174811810002', NULL, '2012-11-30', '2017-11-03', '79.780.453.1-647.000', NULL, 'PNS', 2, 'RATNA PANGASTUTI, M.Pd.I', NULL, NULL, NULL, NULL, NULL, NULL, 'Jl. Ramawijaya 42 RT. 03 RW. 02 Kel. Surodikraman Ponorogo', 35, 3502, 350217, 3502171005, 63419, 1, 2, 'Perempuan', 'Ponorogo', '1981-11-03', 156, 70, 'lurus hitam', 'bulat', 'sawo matang', 'tahi lalat di ujung bibir', NULL, 11, 387, 'd4646-ratna-foto-1.jpg', '081556681125', '081556681125', 'ratnapangastuti@hotmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'O', 'travelling', NULL, 155, 150, 100, '94bab-ratna-kartu-keluarga__1440386162_114.6.74.36.jpg', 28, NULL, 0, 0, 18, 'Ratna Pangastuti, lahir di Ponorogo pada tanggal 03 Nopember 1981, dengan riwayat pendidikan diawalai sjak TK hingga Sarjana Strata Satu di Kota Ponorogo kemudian melanjutkan S2 PGRA di UIN Sunan Kaliaga Yogyakarta. Menikah dengan dikaruniai satu orang anak. Riwayat Pekerjaan mulai mneiti karir sebagai guru RA/TK di Ponorogo tahun 2000-2014, mengajar di perguruan tinggi tentang PAUD sejak 2011 hingga 2015 (sekarang)', 'Pendidikan Anak Usia Dini\nPsikologi Anak Usia Dini');
INSERT INTO `tbpegawai` VALUES (968, '198905172015031006', NULL, '3305131705890003', NULL, '2015-07-28', NULL, '73.340.493.3-523.000', NULL, 'PNS', 2, 'IKHSAN FATAH YASIN, SHI, MH', 35, 3525, 352514, 3525142001, 61161, ' Jl. KH Syafi\'i RT 01 RW 03, Dahanrejo, Kebomas, Gresik', 'Ds. Kedawung RT.07 RW.05 Kec. Pejagoan Kebumen Jawa Tengah', 33, 3305, 330513, 3305132003, 54361, 1, 2, 'Laki-laki', 'Kebumen', '1989-05-17', 166, 55, 'ikal', 'oval', 'sawo matang', NULL, NULL, 11, 382, 'b3a4e-1.jpg', '085727347947', '085727347947', 'ikhsan.fatahyasin@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, NULL, 'membavca, mengajar, nonton, jalan-jalan', NULL, 431, 430, 300, '84de2-kk.jpg', 21, NULL, 0, 0, 1, 'CURRICULUM VITAE\n\n\nA.	Identitas Diri\nNama		        :Ikhsan Fatah Yasin, M.H.\nTempat Tanggal Lahir	:Kebumen, 17 Mei 1989\nAlamat		        :Desa Kedawung RT 07 RW 05, Kec. Pejagoan Kab. Kebumen, Jawa Tengah\nNo. Tlp		        :085727347947/0287 383565\nEmail	       	:ikhsan.fatahyasin@gmail.com\n		\n\nB.	Riwayat Pendidikan\nPendidikan Formal \n1.	TK Aisyiyah, Pejagoan, Kebumen, 1993-1994.\n2.	SDN 4 Pejagoan Kebumen, 1994-2000.\n3.	SMPN 7 Kebumen Tahun 2000-2003.\n4.	MAN 1 Kebumen Tahun 2003-2006.\n5.	S1 UIN Sunan Kalijaga Yogyakarta Tahun 2006-2010.\n6.	Pendidikan khusus profesi advokat di UII. \n7.	S2 Ilmu Hukum di UII 2012-2014 dengan predikat cumlaude.\nPendidikan lain\n1.	Pondok Pesantren Al-Huda, Jetis, Kutosari, Kebumen,Tahun 2000-2006.\n2.	Pondok Pesantren Nurul Ummah, Kotagede, Yogyakarta, Tahun 2006-sekarang.\n3.	Peserta training jurnalistik dasar dengan tema Karena Beritamu, Cermin Kreatifitasmu pada tanggal 15 Desember 2007 di Auditorimum Fak. Peternakan UGM.\n4.	Peserta training jurnalistik berbasis MADIN dan TPA I Se-DIY yang diselenggarakan buletin Lentera pada tanggal 8 Juni 2008.\n5.	Peserta dalam training for islamic teacher se DIY pada tanggal 18 Mei 2008 di PP. Nurul Ummah Yogyakarta.     \n\nC.	Berbagai Sertifikat dan Penghargaan\n1.	Sertifikat dari UIN Sunan Kalijaga Yogyakarta karena menyelesaikan ujian sertifikasi teknologi informasi dan komunikasi dengan hasil sangat memuaskan (A) pada tanggal 26 Juni 2010.\n2.	Sertifikat sebagai Peserta training jurnalistik dasar dengan tema Karena Beritamu, Cermin Kreatifitasmu pada tanggal 15 Desember 2007 di Auditorimum Fak. Peternakan UGM.\n3.	Sertifikat sebagai peserta Peserta training jurnalistik berbasis MADIN dan TPA I Se-DIY yang diselenggarakan buletin Lentera pada tanggal 8 Juni 2008.\n4.	Sertifikat sebagai peserta dalam training for islamic teacher se DIY pada tanggal 18 Mei 2008 di PP. Nurul Ummah Yogyakarta. \n5.	Sertifikat lulus PKPA (Pendidikan Khusus Profesi Advokat) dari Fakultas Hukum UII dan dari PERADI.\n6.	Sertifikat piagam penghargaan dari PKPA FH. UII Yogyakarta tahun 2013. \nD.	Pengalaman Organisasi\n1.	Anggota Divisi Litbang, LP2M (Lembaga Pengabdian dan Pengembangan Masyarakat) PP. Nurul Ummah Tahun 2007-2008.\n2.	Sekretaris Sanggar Teater dan Sastra komunitas SANGKAL, PP. Nurul Ummah, Tahun 2007-2009. \n3.	Staff buletin Lentera yang diterbitkan divisi LITBANG LP2M.\n4.	Kesiswaaan di Madrasah Diniyah Nurul Ummah, Kotagede, Yogyakarta.\nE.	Kejuaraan\n1.	Menjadi tiga besar nominator lomba baca novel pesantren se DIY pada tahun 2008.\n2.	Juara I baca kitab tingkat awaliyah di PP.Nurul Ummah, Kotagede Yogyakarta pada tahun 2006.\n3.	Juara III Peserta Terbaik dalam PKPA (Pendidikan Khusus Profesi Advokat) di Fakultas Hukum UII tahun 2013.\nF.	Pengalaman Kerja\n1.	Editor Free Lance di penerbit Pustaka Pesantren LKiS pada tahun 2012\n2.	Penerjemah Free Lance Arab-Indonesia.\n3.	Pengajar di PP.Nurul Ummah sejak 2012-2014.\n4.	Advokat magang di kantor advokat Heniy Astianto, S.H. dan Rekan tahun 2013.\n5.	Advokat magang di kantor advokat D.Sriyanto, S.H., M.H., M.M.\n\nG.	Karya yang Dipublikasikan\n1.	Opini Tanggal 14 Desember di Koran Kedaualtan Rakyat dengan judul Mencari Keadilan Untuk Udin \n\n', 'hukum');
