INSERT INTO `tbpegawai` VALUES (971, '198408232015031002', '06230088402', '3373022308840001', NULL, '2013-02-13', '2017-08-23', '546769845505000', NULL, 'PNS', 2, 'MUHAMMAD QOBIDL \'AINUL ARIF, S.IP., M.A.', 35, 3578, 357802, 3578021004, NULL, 'Jln. Jemur Wonosari, Gang Masjid No. 29 A (Belakang Laundry), Surabaya\n', 'Jln. Timbulrejo No. 11 RT.07 RW.01 Gendongan Tingkir Salatiga', 33, 3373, 337302, 3373021002, 50743, 1, 2, 'Laki-laki', 'Salatiga', '1984-08-23', 167, 76, 'Ikal', 'Oval', 'Sawo matang', 'Hidung besar', 'Mata minus (-3)', 11, NULL, '8d0b3-002.jpg', '0298314611', '081575609991', 'm.qobid@uinsby.ac.id', 'WNI', 'qobid.wordpress.com', NULL, 'S446940', '2008-11-03', 'Republik Indonesia', 'B', 'Berenang dan memasak', NULL, 414, 410, 300, '54492-kk-m-qobid.jpg', 53, NULL, 0, 0, 18, 'Muhammad Qobidl \'\'\'\'Ainul Arif terlahir 23 Agustus 1984. Berkarir di dunia kampus sejak tahun 2006 sebagai asisten dosen. Tahun 2007, sembari kuliah di program M.A. HI FISIP UGM, menjadi asisten peneliti di Laboratorium Studi Globalisasi HI FISIP UGM. Tahun 2010 berkarir sebagai dosen di Universitas Muhammadiyah Malang. Tahun 2011 berkarir sebagai Staf Direktur di Pesantren Islam Al Irsyad Tengaran. Tahun 2013 berkarir sebagai dosen di Prodi. HI FISIP Universitas Sebelas Maret Surakarta, hingga pada tahun 2015 diterima sebagai CPNS di UIN Sunan Ampel Surabaya. Kata-kata mutiara yang menjadi inspirasinya adalah, \"Saya yakin pendapat saya benar dengan kemungkinan adanya kesalahan padanya, dan saya yakin pendapat anda salah dengan kemungkinan adanya kebenaran padanya\" (Al Imam As Syafi\'\'\'\'\'\'\'\'i)', 'Studi Timur Tengah dan Dunia Islam, Metodologi Ilmu Hubungan Internasional, Integrasi Ilmu Hubungan Internasional.');
INSERT INTO `tbpegawai` VALUES (972, '198710022015031005', NULL, '3513140210870003', NULL, '2014-07-15', '2019-07-15', '71.371.505.0-515.000', NULL, 'PNS', 2, 'HOLILUR ROHMAN, MHI', 35, 3578, 357802, 3578021004, 852259500, 'Wonocolo - Pabrik Kulit No. 130 Surabaya', 'Mlaten RT 05 RW 03 Kel. Mlaten Kec. Mijen Kab. Demak Jawa Tengah', 33, 3321, 332110, 3321102003, 59583, 1, 2, 'Laki-laki', 'Probolinggo', '1987-10-02', 157, 60, 'hitam', 'bulat lonjong', 'coklat', 'berkaca mata', NULL, 11, 382, '520fd-foto-baru.jpg', NULL, '085731478540', 'elrahman10@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'O', 'futsal dan tenis meja', NULL, 121, 120, 100, 'e1dcd-kk.jpg', 21, NULL, 0, 0, 18, 'CURICULUM VITAE\n\n\nA.	IDENTITAS DIRI\n-	HOLILURROHMAN, M.H.I\n-	Probolinggo, 02 Oktober 1987\n-	Mlaten, Rt 5 Rw 3, Mijen, Demak, Jawa Tengah\n-	085731478540\n\nB.	PENGALAMAN PENDIDIKAN\n-	MI NU Kraksaan Probolinggo\n-	Mts Nurul jadid, Paiton Probolinggo\n-	MAK Nurul Jadid, Paiton Probolinggo\n-	IAIN Sunan Ampel Surabaya, Jurusan Ahwal al-Syakhsiyah\n-	Program Pasca Sarjana IAIN Sunan Ampel Surabaya, Program study Dirasah Islamiyah, konsentrasi Syariah\n\nC.	PENGALAMAN ORGANISASI\n-	Ketua KAMANURJA (Keluarga Mahasiswa Alumni Nurul Jadid)\n-	Wakil Presiden BEM Fakultas Syariah IAIN Sunan Ampel\n-	Wakil Bendahara PMII Cabang Surabaya\n-	Sekretaris UKPI (Unit Kegiatan pengembangan Intelektual)\n\nD.	PENGALAMAN DUNIA KERJA\n-	Direktur KAMANURJA INSTITUTE GRUP (Lembaga Bimbingan Belajar dan Kursusu bahasa arab & inggris)\n-	Sekretaris Direktur Pusat Pengembangan Management Zakat dan Wakaf\n-	Dosen Pesantren Mahasiswa IAIN Sunan Ampel \n-	Direktur Lingkar Study Filsafat dan Hukum\n-	Team Lembaga Pendidikan dan Pengkajian ilmu al-Quran\n\nE.	IDENTITAS PENDUKUNG\n-	Tinggi Badan	: 159 cm\n-	Berat Badan	: 61 kg\n-	Golongan Darah	: 0\n\nF.	KOMITMEN KERJA\n-	Kerja adalah amanah, maka saya akan bekerja dengan penuh tanggung jawab\n-	Kerja adalah ibadah, maka saya akan menjaganya\n-	Kerja adalah anugerah hidup, maka saya harus menjaga untuk tetap bekerja dengan baik\n-	Nilai terpenting dalam kehidupan saya adalah kejujuran\n\n\nHormat saya,\n\n\nHOLILURROHMAN, M.H.I\n', 'Olahraga\n1) Futsal\n2) Tenis Meja\n\nMinat: Enterpreneursip');
INSERT INTO `tbpegawai` VALUES (973, '199007122015032008', '-', '3523095207900001', NULL, '2016-07-12', '2021-07-12', '73.387.355.8-648.000', NULL, 'PNS', 2, 'ZAKIYATUL ULYA, M.HI', 35, 3523, 352309, 3523092013, 62366, 'Dsn. Ponco RT 005 RW 001, Desa Suciharjo Kec. Parengan, Tuban', 'Dsn. Ponco RT 005 RW 001, Desa Suciharjo Kec. Parengan, Tuban', 35, 3523, 352309, 3523092013, 62366, 1, 1, 'Perempuan', 'Tuban', '1990-07-12', 162, 58, 'BEROMBAK', 'BULAT', 'KUNING LANGSAT', 'TAHI LALAT DI BIBIR KANAN BAWAH', 'TIDAK ADA', NULL, NULL, '39144-foto-4x6.jpg', NULL, '085746721882', 'ulyaelzakiya@gmail.com', 'WNI', '-', NULL, '-', NULL, '-', 'B', 'MEMBACA', NULL, 121, 120, 100, '3832a-kk.jpg', 21, '-', 0, 0, 18, '                DAFTAR RIWAYAT HIDUP\n\nA.	Data Pribadi\n1.	Nama	: 	Zakiyatul Ulya\n2.	Tempat, Tanggal lahir	: 	Tuban, 12 Juli 1990 \n3.	Jenis Kelamin	: Perempuan\n4.	Agama	: Islam\n5.	Kebangsaan	: Indonesia\n6.	Status Perkawinan	: Belum Menikah\n7.	Pendidikan Terakhir	: S-2 (Magister)\n8.	Alamat	: Desa Suciharjo RT 05/ RW 01, Kec. Parengan Kab. Tuban, Jawa Timur \n9.	No. HP 	:	085746721882\n10.	E-mail	: ulyaelzakiya@gmail.com\n\nB.	Pendidikan Formal	\n1.	TK Darma Wanita III Suciharjo Parengan Tuban (1994-1996/ terlampaui selama 2 tahun)\n2.	SDN Suciharjo 1 Parengan Tuban (1996-2002/ terlampaui selama 6 tahun)\n3.	MTsN 1 Bojonegoro (2002-2005/ terlampaui selama 3 tahun)\n4.	MA Islamiyah Sunnatunnur Senori Tuban (2005-2008/ terlampaui selama 3 tahun)\n5.	S-1 Fakultas Syariah Jurusan Ahwal al-Syakhsiyah IAIN Sunan Ampel (2008-2012/ terlampaui selama 3  tahun)\n6.	S-2 Konsentrasi Syariah Pascasarjana UIN Sunan Ampel Surabaya (2012-2014/ terlampaui 1  tahun)	\n\nPendidikan Non Formal\n1.	Pondok Pesantren Mansyaul Huda II (2005-2008/ terlampaui selama 3 tahun)\n2.	Pesantren Mahasiswa IAIN Sunan Ampel Surabaya (2008-2012/ terlampaui selama 3  tahun)\n3.	Kursus Bahasa Inggris di MAHESA INSTITUTE Pare Kediri Jawa Timur Tahun 2009 (selama 1 bulan)\n4.	Kursus Bahasa Inggris di GENTA (Golden English  Training Area) Pare Kediri Jawa Timur Tahun 2010 (selama 1 bulan)\n\nC.	Pelatihan \n1.	Sekolah Filsafat oleh SEMA Syariah IAIN Surabaya Tahun 2009 (selama 3 hari)\n2.	Sekolah Ushul Fiqih SEMA Syariah IAIN Surabaya Tahun 2009 (selama 3 hari)\n3.	Workshop Metode Istinbath Hukum Islam bagi Alumni Program Beasiswa Santri Berprestasi Kementrian Agama R.I yang diselenggarakan oleh Fakultas Syariah IAIN Sunan Ampel Surabaya di PP Salafiyyah Syafiiyyah Situbondo Tahun 2009 (selama 1 bulan)\n4.	Praktikum KUA di KUA Wiyung Surabaya Tahun 2011 (selama 1 minggu)\n5.	Praktek Peradilan Agama di Pengadilan Agama Bojonegoro Tahun 2011 (selama 12 hari)\n6.	Pelatihan Advokat bagi Alumni Program Beasiswa Santri Berprestasi Kementrian Agama R.I yang diselenggarakan oleh Fakultas Syariah IAIN Sunan Ampel Surabaya Tahun 2012 (selama 1 minggu)\n\nD.	Karya Ilmiah\n1.	Analisis Hukum Islam terhadap Penetapan Ahli Waris Penerima Santunan Jasa Raharja dalam PP. 18 Tahun 1965 (Skripsi)\n2.	Implementasi Hukum Waris Islam dan Hindu di Kecamatan Krembung Sidoarjo (Tesis)\n \nE.	Prestasi\n1.	Sering mendapat penghargaan sebagai Peserta Terbaik dalam kegiatan yang diadakan oleh suatu Organisasi, baik intra maupun ekstra kampus.\n2.	Peserta Lomba Debat Konstitusi Perguruan Tinggi se-Indonesia Tingkat Regional V yang diselenggarakan oleh Mahkamah Konstitusi Tahun 2011\n3.	Sering terlibat dalam kepengurusan dan kepanitiaan suatu Organisasi, baik intra maupun ekstra kampus\n4.	Wisudawan terbaik program Sarjana IAIN Sunan Ampel Surabaya semester Gasal Tahun Akademik 2011/2012 (menyelesaikan studi S-1 hanya dalam waktu 3  tahun dengan IPK 3,82)\n5.	Berhasil menyelesaikan studi S-2 hanya dalam waktu 1  tahun dengan IPK 3,84 (Cumlaude)\n\nF.	Pengabdian dan Pengalaman Kerja \n1.	Tutor Diklat Bahasa Arab yang diselenggarakan oleh CSS MoRA (Comunity of Santri Scholars of Ministry of Religious Affairs) IAIN Sunan Ampel Surabaya di PP. Miftahul Ulum al-Yasini Areng-Areng Pasuruan Tahun 2010 (selama 1 hari)\n2.	Tutor Penyuluhan NTCR (Nikah, Talak, Cerai dan Rujuk) yang diselenggarakan oleh CSS MoRA IAIN Sunan Ampel Surabaya di STIT Jembrana Bali Tahun 2011 (selama 1 hari)\n3.	Tutor Pelatihan Managemen Organisasi yang diselenggarakan oleh CSS MoRA IAIN Sunan Ampel Surabaya di SMP al-Istiqamah Pacet Majokerto 2012 (selama 1 hari)\n4.	Tutor Diklat Penulisan Makalah yang diselenggarakan oleh CSS MoRA IAIN Sunan Ampel Surabaya Tahun 2013 (selama 1 hari)\n5.	Guru di Madrasah Aliyah Sunnatunnur Senori Tuban Tahun Ajaran 2012/2013 (selama 1 Tahun)\n6.	Pendamping Santri di Pondok Pesantren Mansyaul Huda Tahun Ajaran 2012/2013 (selama 1 Tahun)\n7.	Guru di Mts Telasih Sidoarjo Tahun 2013/2014 (selama 1 Tahun)\n8.	Guru di Madrasah Diniyah Nurul Huda Desa Balonggarot Kec. Krembung Kab. Sidoarjo Tahun 2014 (selama  Tahun) \n9.	Asisisten Dosen di Fakultas Syariah IAIN Sunan Ampel Surabaya Tahun Ajaran 2013/2014 (selama 1 semester)\n10.	Dosen di STAI Sunan Giri Bojonegoro Tahun Ajaran 2014/2015 (selama 1 semester)\n', 'Fiqih (Perkawinan dan Kewarisan)');
