INSERT INTO `tbpegawai` VALUES (978, '198306242015032002', NULL, '3503126406830001', NULL, '2012-11-15', '2017-06-24', '66.913.146.8-629.000', NULL, 'PNS', 2, 'PUJI ASTUTIK, S.Pd, M.Pd.I', 35, 3503, 350312, 3503122004, 66371, 'Desa Pogalan Kecamatan Pogalan Kabupaten Trenggalek', 'Desa Pogalan Kec. Pogalan Kab. Trenggalek', 35, 3503, 350312, 3503122004, 66371, 1, 1, 'Perempuan', 'Trenggalek', '1983-06-24', 150, 42, 'Lurus', 'Oval', 'Sawo matang', 'Lesung pipi', NULL, 11, 387, 'a99e7-20150107_162218~2~2.jpg', '0355793593', '085736732723', 'puji.pogalan@gmail.com', 'WNI', NULL, NULL, NULL, NULL, NULL, 'O', 'Travelling', NULL, 153, 150, 100, '5a012-kk.jpg', 28, NULL, 0, 0, 18, 'Saya lahir di Trenggalek pada tanggal 24 Juni 1983. Lahir dari rahim seorang ibu yang peyayang yaitu ibunda Hj. Supiyah dan seorang Ayah yang tegas dalam mendidik anak-anaknya yaitu H.    Katiran A Hamdani.         \n\nPendidikan SD sampai SMA saya tempuh di kota Trenggalek tercinta. Selama menjadi pelajar di Trenggalek saya terlibat dalam kegiatan kerohanian Islam di SMA, kemudian dirumah membina Taman Pendidikan Al Quran (TPQ) al Muslimun bersama orang tua. \n\nPada tahun 2002 alhamdulillah saya lulus SMPTN di Universitas Negeri Malang mengambil Jurusan Pendidikan Matematika. Selama kuliah saya terlibat dalam kegiatan kerohanian Islam dan juga memberikan les privat matematika. Alhamdulillah, Maret 2007 saya di wisuda dan memutuskan diri untuk mengembangkan ilmu di kampung halaman. Mulai dari membuka lembaga bimbingam belajar, mengajar di MTs Miftahul Jannah dan mengelola TPQ Al Muslimun. Ketika menjadi guru saya berkesempatan meraih juara 1 lomba inovasi pembelajaran tingkat kabupaten.\n\nTahun 2010 saya putuskan kuliah S2 mengambil jurusan Pendidikan Islam konsentrasi Manajemen Pendidikan Islam. Keputusan ini saya ambil untuk mengembangkan TPQ dan Madrasah Diniyah al Muslimun yang telah dirintis orang tua. Dan alhamdulillah ilmu S2 teraplikasikan. \n\nSetelah lulus S2 tahun 2012, mulai bulan Februari 2013 saya memperoleh kesempatan mengajar di STKIP Trenggalek setelah lulus tes seleksi Dosen. Dan mulai 1 Juli 2015 amanah kerja berpindah di UIN Sunan Ampel Surabaya. Semoga amanah yang ada dipundak dapat terlaksana dengan baik dan penuh tanggungjawab. Aamiin. \n\nDemikian sekelumit biografi saya, semoga bermanfaat. Aamiin..\n', 'Agama dan Pendidikan');
