INSERT INTO `tbpegawai` VALUES (983, '198601232015031004', '-', '3525122301860001', '764cb-ktp.jpg', '2013-03-20', '2018-01-23', '89.681.535.4-612.000', 'e8d27-npwp.jpg', 'PNS', 1, 'MUHAMMAD MAARIF, S.Pd', 35, 3578, 357804, 3578041001, 60243, 'JL. KARANGREJO VIC/ 111', 'JL. R.A. KARTINI NO. 17 RT. 10 RW. 02', 35, 3525, 352512, 3525122016, 61152, 1, 1, 'Laki-laki', 'Gresik', '1986-01-23', 173, 65, 'Ikal', 'Lonjong', 'Sawo Matang', 'Tahi Lalat', '-', 9, NULL, 'cda19-p_20150827_143618.jpg', '0318273955', '085648065198', 'ayiechem04@gmail.com', 'WNI', '-', NULL, '-', NULL, '-', 'B', 'Membaca', NULL, NULL, NULL, NULL, 'a12e0-kk.pdf', 28, NULL, 0, 0, 18, 'Lahir di Gresik, 23 Januari 1986. Menempuh pendidikan tingkat SD-SMA di YPPQ Bungah Gresik. Pada tahun 2004, melanjutkan studi S1 di Universitas Negeri Surabaya dengan mengambil jurusan Pendidikan Kimia.\n\nSetelah lulus program S1, pada tahun 2009-2015 menjadi tenaga pengajar di SMA GIKI 1 Surabaya dan MA Amanatul Ummah program Akselerasi, Pacet. Kemudian mulai Juli 2015 menjadi tenaga laboran di UIN Sunan Ampel Surabaya.', 'Sains dan Teknologi');
